INSERT INTO `message` VALUES (11,NULL,'Homepage','\r\n\r\n<!--  special school urgent notice -->\r\n\r\n<p>\r\n<!-- 置顶信息 -->\r\n<div>\r\n<span style=\"align:center;color:red;\">\r\n<iframe src=\"https://calendar.google.com/calendar/embed?height=600&amp;wkst=1&amp;bgcolor=%23ffffff&amp;ctz=America%2FNew_York&amp;src=Y181Y2F2YTNscGo1MzlzY2k5MzNnNGs3amptc0Bncm91cC5jYWxlbmRhci5nb29nbGUuY29t&amp;src=ZW4udXNhI2hvbGlkYXlAZ3JvdXAudi5jYWxlbmRhci5nb29nbGUuY29t&amp;color=%23F6BF26&amp;color=%230B8043&amp;mode=AGENDA\" style=\"border:solid 1px #777\" width=\"800\" height=\"600\" frameborder=\"0\" scrolling=\"no\"></iframe>\r\n</span></div>\r\n<span style=\"align:center;color:red;\"><h2><a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a></span>\r\n<span style=\"align:center;color:red;\"><h2><a href=\"http://hxcs.org/competition.aspx\" target=\"_blank\">我校同学林佳曦(10122)，李珈煦(11122)， 袁嘉陆(10222)，李佳铭(11222)，林乐曦(12222)，曹汉(13222)，玉翎(1)222)， 陆一凡(15222)，戴灵灵(10322）参加了总校2020书法绘画大赛，预祝他们获得好成绩</a></h2></span>\r\n    <span style=\"align:center;color:red;\"><h2><a href=\"https://drive.google.com/file/d/1U7Z8wmpUj4SLhNh71jsr3evugllJmtOf/view?usp=sharing\" target=\"_blank\">祝贺我校Kai Yang, Michael Tan, Elias Chang, Albert Chen在TeenTeachKids Hackathon 2020 编程大赛中取得优异成绩!</a></h2></span>\r\n<span style=\"align:center;color:red;\"><h2><a href=\"http://www.huaxiabh.org/Home/ViewMessage/30\" target=\"_blank\">Call for high school volunteers for 2020-2021!</a></h2></span>\r\n\r\n<span style=\"align:center;color:red;\"><h2><a href=\"https://drive.google.com/file/d/1cIuHC10SZGS-HuRMwI8CqRAJTPTUQpp1/view?usp=sharing\" target=\"_blank\">Request refund check for cancelled Spring 2020 classes due to COVID-19</a></h2></span>\r\n\r\n<span style=\"align:center\"><h2><a href=\"https://drive.google.com/file/d/1mx6kvcXO0NZ20Ewst7r42YEp81LykPpR/view?usp=sharing\" target=\"_blank\">2020-2021 School Calendar 2020-2021学年校历</a></h2></span>\r\n\r\n<span style=\"align:center\"><h2><a href=\"https://docs.google.com/document/d/1afe0B0LxjVHxGqDuF_8za5KZQw85yBh0fmliXxbpDfA/edit?usp=sharing\" target=\"_blank\">2020-2021 Course Schedule</a></h2></span>\r\n\r\n<span style=\"align:center;color:red;\"><h2><a href=\"http://www.huaxiabh.org/Home/ViewMessage/44\" target=\"_blank\">Donate to our school 如何向我校捐赠?</a></h2></span>\r\n\r\n<!-- 新学期注册公告 -->\r\n<span style=\"align:center\"><h2><a href=\"/Home/ViewMessage/53\" target=\"_blank\">2020-2021 School Year Registration</a></h2></span>\r\n<p>\r\nBerkeley Heights Huaxia Chinese School (BHHXCS) is located at Berkeley Heights, opens to all residents in the neighborhood. BHHXCS is a <strong>501(c)(3) nonprofit organization</strong>, a community oriented, cultural educational institute. Early Bird Registration for the 2020-2021 school year extended to Friday, 7/31 </p>\r\n\r\n<div style=\"font-weight:bold; color:red;padding-left:5px;\">\r\n<p>* To help parents deal with the uncertainty and ease the concerns might be caused by COVID-19 possibly into new school year, our school will stay online during the Fall semester while school closely monitor the situation for the next Spring, any Cultural/Enrichment classes that can\'t be offered online are eligible for prorated refund/credit.\r\n</p>\r\n</div>\r\n\r\n<p>\r\nIMPORTANT: Please refer to <br> \r\n<ul>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/document/d/1YZZnxl9jNEzqq1f6tCCoFeKuOD1U6QKYtRpWBb0KebU/edit?usp=sharing\" target=\"_blank\">注册须知中文版</a></span> || <span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/document/d/1yNgmr_pxLtE6qbErxrYLxXxqLL02jkMqU5TE_o2oNb8/edit?usp=sharing\" target=\"_blank\">Registration Guidelines</a></span>\r\n</li>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/spreadsheets/d/1eFtg3fIrGAI5hoHOgV10N1xF9Q_X4nh6E2n4PPXEpRc/edit?usp=sharing\" target=\"_blank\">Course Catalog (课程目录及学费)</a></span>\r\n</li>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/file/d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\">Course Descriptions for Chinese Classes (中文课)</a></span>\r\n</li>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/document/d/1afe0B0LxjVHxGqDuF_8za5KZQw85yBh0fmliXxbpDfA/edit?usp=sharing\" target=\"_blank\">Course Schedule</a></span>\r\n</li>\r\n<li>\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/file/d/1j8ZG4eSN0YMgCaS6So6sJvYirddxsiwi/view?usp=sharing\" target=\"_blank\">Change Registration Form (for Change/Cancel registration 退换课请填写此表并email to accounting@huaxiabh.org)</a></span>\r\n</li>\r\n</p>\r\n\r\n<p>\r\n 1. One account per family <span style=\"font-weight:bold; color:red;\"><del>Early Bird saving of $50 Registration Fee by July 6</del> $50 discount honored for all families, no expiration date for peace of mind!</span>\r\n</p>\r\n\r\n<p>\r\nTo honor your registration, Do make sure you exactly follow the above-mentioned <a href=\"https://docs.google.com/document/d/1yNgmr_pxLtE6qbErxrYLxXxqLL02jkMqU5TE_o2oNb8/edit?usp=sharing\" target=\"_blank\">Registration Guidelines</a>, pay tuition balance by \r\n<ul>\r\n    <li>Zelle Pay (Chase Quickpay etc) is highly recommended, sending payment to accounting@huaxiabh.org, adding memo：Do put your registered school account username (email) and name, Student’s name, as completed as possible if text field allowed by your online banking\r\n    </li>\r\n    <li>PayPal to accounting@huaxiabh.org, use fee-free option(otherwise your payment will be returned, refer to Registration Guidelines for detailed instruction!) \r\n    </li>\r\n    <li>or include signed copy of Registration Summary and a check payable to <strong>BH Huaxia</strong> mailing to  364 Springfield Ave #539, Berkeley Heights, NJ 07922, <span style=\"font-weight:bold; color:red;\">failure to do in 7 days so will void your registration</span>.\r\n   </li>\r\n</ul>\r\n</p>\r\n\r\n<p>\r\n2. <a href=\"https://drive.google.com/open?id=0B8E9IyDma37Ob3NqNzZWS2JfWTQ\" target=\"_blank\"><font color=\"blue\">中文课教学特点介绍</font></a>, <a href=\"http://www.hwjyw.com/textbooks/downloads/zhongwen/\" target=\"_blank\"><font color=\"blue\">Download Textbook</font></a> \r\n\r\n\r\n<li><a href=\"https://drive.google.com/file/d/1zyAaZ9pKv9hKjj-wCQXaEjSzbugvmQvN/view?usp=sharing\" target=\"_blank\">学前小班 Preschool</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1b7uBN1lpxKVuhZYJk93XvjviJoCvxD-z/view?usp=sharing\" target=\"_blank\">学前大班 Kindergarten</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\">中文一年级至九年级 1st to 9th Grade</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1AosxHJYHAtF6kKjaxSPAkIg1mZUh9JGD\" target=\"_blank\">双语班 CSL (Chinese as Second Language)</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1S8RRDi1UjijlMQJ2g0IYzDqPFrC0N3az\" target=\"_blank\">中文补习班(少年) Junior Mandarin</a></li>\r\n<li>AP Chinese (10th Grade and higher, passed HSK4)</li> \r\n</p>\r\n<p>\r\n3. <span style=\"font-weight:bold; color:blue;\">All popular Cultural classes to be offered (<span style=\"font-weight:bold; color:red;padding-left:5px;\">全部小班制教学, 位置有限! Small class size, 4-6 kids only!<span>):</span>\r\n<ul>\r\n<span style=\"font-weight:bold; color:blue;\">STEM/Enrichment classes:</span>\r\n\r\n<li>英文阅读写作 English Reading&Writing offered by KEC补习中心 (<a href=\"https://drive.google.com/file/d/1uW3JBY-TTA2BTtKnlSmG-x7g63L56Pcy/view?usp=sharing\" target=\"_blank\">3 classes for 3rd-4th, 5th-6th and 7th-9th grades</a>)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1lSmDWo5V49MLbWnx2NmMeeNhzo0V0fZs/view?usp=sharing\" target=\"_blank\">少儿编程班 (Kids Python, recommend 5th Grade+)</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">space limited, register asap before full<span></li> \r\n\r\n<li>\r\n    <ul><a href=\"https://drive.google.com/file/d/1mNxzsi-ICKVLQebc5TOIbr0x43PsNYz_/view?usp=sharing\" target=\"_blank\">BHHXCS-ThinkAI少儿人工智能课(AI001, AI002) 课程教学大纲</a>\r\n         <li><a href=\"https://drive.google.com/file/d/1SVw0CYAWDCsjE7gbEWhcKhzPSCsEGpFv/view?usp=sharing\" target=\"_blank\">AI001计算机编程小班 Scratch (recommend 8yr+)</a></li>\r\n         <li><a href=\"https://drive.google.com/file/d/1O1gIxtLMQoNMNJcBz9aGeY1l7MqCl7wI/view?usp=sharing\" target=\"_blank\">AI002计算机编程大班 Scratch+AI (10yr+)</a> <span style=\"font-weight:bold; color:red;padding-left:5px;\">New class, Hot! filled very soon!<span></li>\r\n    </ul>\r\n</li>\r\n<li><a href=\"https://drive.google.com/open?id=1Rf7OcLxXT-JXWjrUqmuQjHbLRhqRMil7\" target=\"_blank\">3D 打印（3D Printing & Science Class)</a></li> \r\n\r\n<li><a href=\"https://drive.google.com/file/d/1CXC7lfJ8I4PUE4cM_CiqSKW9lA-zhTBG/view?usp=sharing\" target=\"_blank\">几何 Geometry </a>(for rising 7-8th Grade) <span style=\"font-weight:bold; color:red;padding-left:5px;\">New class!<span></li>\r\n<li><a href=\"https://drive.google.com/file/d/1CXC7lfJ8I4PUE4cM_CiqSKW9lA-zhTBG/view?usp=sharing\" target=\"_blank\">代数 Algebra I&II </a>(for rising 7-8th Grade) <span style=\"font-weight:bold; color:red;padding-left:5px;\">New class!</li>\r\n<li><a href=\"https://drive.google.com/file/d/15S-2Ri5eeIT_3evI1S064LjsYfYo91Q7/view?usp=sharing\" target=\"_blank\">竞赛数学 AMC8 (for rising 6/7/8 grade)</a>, <a href=\"https://drive.google.com/file/d/1UqJ0dGrwcU52IjZSJ3u4JzorY3RevrRn/view?usp=sharing\" target=\"_blank\">AMC10 (for rising 9/10 grade)</a>, <a href=\"https://drive.google.com/file/d/1UqJ0dGrwcU52IjZSJ3u4JzorY3RevrRn/view?usp=sharing\" target=\"_blank\">AMC12 (for rising 10th grade)</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">New class, filled very soon!<span></li>\r\n\r\n<li><a href=\"https://drive.google.com/open?id=1Lm80ioWLPpyQslmlzQAO45RKkAQ97enU\" target=\"_blank\">SAT阅读和写作班 SAT Reading & Writing</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1o4FaWnPZV0udUPrlsyOfMmmvfloO5Ltd/view?usp=sharing\" target=\"_blank\">数学强化班 Math Enrichment</a> 1st/2nd Grade, 3rd/4th Grade, 5th/6th Grade textbook Singapore Math<span style=\"font-weight:bold; color:red;padding-left:5px;\">For Grade 7&8 concentrate on AMC8-American Mathematics Contest 8, register asap before full<span></li>\r\n\r\n\r\n<span style=\"font-weight:bold; color:blue; padding-top: 20px;\">Other Enrichment/Cultural classes:</span>\r\n\r\n<li><a href=\"https://drive.google.com/open?id=11Bc4V5PC8FTroBdITB4cBePA25Lh9TCN\" target=\"_blank\">国际象棋 Chess</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1dzEkQoQ58iAn48Xtx7c9asnjz9YZSHuX/view?usp=sharing\" target=\"_blank\">围棋(基础班和进阶班) Go (WeiQi)</a></li>\r\n\r\n<li><a href=\"https://drive.google.com/file/d/1nOu-RKAgxM6zBW1JzrgQTREln-E7OLw5/view?usp=sharing\" target=\"_blank\">基础芭蕾 Kids Ballet</a>(6-10 years old)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1ZuPcoU5Gp8M2QlUOy6Rv00xj9Qq8E9js/view?usp=sharing\" target=\"_blank\">书法+水粉画 Chinese Calligraphy&Painting</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1xG_1OJ6s4BftmQq8ElPdIUdO_we-xJJX/view?usp=sharing\" target=\"_blank\">唱游班 Kids Singing& Dancing</a>(3-6岁)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1HJ1hSzRVEk0i01qCMBzul5PaF-gsgGfy/view?usp=sharing\" target=\"_blank\">手工Art & Craft</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1-RitNgShTqwO-KygNKM0yFefFzzD5q9V\" target=\"_blank\">服装缝制工艺课 Sewing and Tailoring Technique</a> (年龄不限 opens all age groups)</li>\r\n\r\n<li><a href=\"https://drive.google.com/file/d/1Ld9XrDq6ELvkKCHnY-Bs_3Z6lWIxnfiD/view?usp=sharing\" target=\"_blank\">美术绘画 Drawing Art </a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Q8obUc60WPJX0x5Tm6meozycWcubOQ_e/view?usp=sharing\" target=\"_blank\">免费ESL英语成人班</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Free to local residents 面向新移民和探亲父母等<span></li>\r\n</ul>\r\nThe Course Schedule will be finalized in late August according to the the enrollment of the classes.\r\n</p>\r\n<p>\r\n4. School opens ONLINE on Saturdays (1:30pm - 5pm) during school year of BH Public Schools.\r\n\r\n\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n  <a href=\"https://www.tapinto.net/towns/berkeley-heights/sections/giving-back/articles/local-chinese-community-donates-personal-protection-equipment-to-frontline-and-healthcare-workers\" target=\"_blank\"><img src=\"https://drive.google.com/uc?export=view&id=1FM2DKP5LuQWYngH098Qp8eWJLvk3mLaf\" style=\"height: 80%; width: 80%;margin-left: auto;margin-right: auto;\"><a/>\r\n<p style=\"font-size: 1.2em; font-weight: bold;\">\r\n      <a href=\"https://www.tapinto.net/towns/berkeley-heights/sections/giving-back/articles/local-chinese-community-donates-personal-protection-equipment-to-frontline-and-healthcare-workers\" target=\"_blank\">\"Local Chinese Community Donates Personal Protection Equipment to Frontline and Healthcare Workers\", reported by TAPinto, 4/15, 2020</a>\r\n      </p>\r\n</div>\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n  <img src=\"https://drive.google.com/uc?export=view&id=1qQv-DTPP9lQbVTK_NtfzqJboN5ptgBMB\" style=\"height: 80%; width: 80%;margin-left: auto;margin-right: auto;\">\r\n</div>\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"https://smile.amazon.com/ch/81-1283070\" target=\"_blank\"><img src=\"http://www.huaxiabh.org/Content/img/amazonsmile.png\" style=\"height: 50%; width: 50%;\"></a>\r\n      <p style=\"font-size: 1.2em; font-weight: bold;\">\r\n      Simply click on the logo above to enter Amazon.com and a percentage of any resulting purchases will be returned to the Berkeley Heights Huaxia Chinese School.  What a better way to support our school while shopping for your everyday purchases without spending any extra money!\r\n      </p>\r\n</div>\r\n\r\n\r\n\r\n\r\n<div id=\"homepage-sticky-notice\" class=\"row\" style=\"padding-top: 20px;\">\r\n\r\n<p>\r\n<font color=\"red\">For People Who Don\'t Understand Chinese! </font>\r\n <a href=\"http://www.huaxiabh.org/Home/ViewMessage/28\"> Please Click Here For School Class Information and Registration Process</a>\r\n</p>\r\n\r\n</div>','notification','2016-02-29 00:18:48',NULL),(12,NULL,'伯克利华夏中文学校教师诚聘','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2>伯克利华夏中文学校教师诚聘通告 </h2>\r\n<p>\r\n伯克利华夏中文学校是一个由志愿者自发建立的以服务社区为中心的周末中文学校。学校教授简体中文和汉语拼音，传承和传播中国文化。<p>\r\n<p> \r\n除了开设中文课程外，学校还开设其它相关中国文化课程，如绘画，中国功夫，太极，中国结及手工，中国民乐及棋牌舞蹈等。 </p>\r\n<p>\r\n本校长期诚聘中文教师和文化课教师, 我们热切希望有经验、有才能和有志于教育事业的同仁与我们一起，为本地中国文化的传播和海外中文教育事业的发展尽心尽力。\r\n</p>\r\n<p>\r\n基本条件：<br/>\r\n1)中文课的老师必须具有大学学历; 能说纯正的普通话; 有一定的英文会话能力和一定的中文教学经验者优先。<br/>\r\n2）文化课的老师要有一定的专业特长和教育工作背景。<br/>\r\n3）对中文学校的教学有兴趣和热情，对工作要认真负责，同时要求对儿童要有爱心和耐心。\r\n</p>\r\n<p>\r\n学校的上课时间为周六下午, 校址在 Columbia Middle School, 临近 78 高速 41 号出口。有兴趣的朋友请把你的简历和你对所教课程的简单描述，同报名表一起用电子邮件寄至info@huaxiabh.org. 我们学校长期诚聘有志于海外中文教育的老师, 如果你申请的时候没有空缺的教师职位，学校会把你放在waiting-list, 有合适职位时会优先考虑你！\r\n\r\n报名表下载可以点击下面的链接。\r\n</p>\r\n<p>\r\n<a href=\"https://drive.google.com/file/d/0B8E9IyDma37OWGxxZHpLSDlCT1E/view?usp=sharing\">Please Click this Link to Get Application Form</a>\r\n</p>\r\nThank you！\r\n</p>\r\n<p>\r\n<font color=\"red\">如果您对中文教育有爱和热情,就请加入我们! </font>\r\n','notification','2016-03-03 19:43:21',NULL),(13,NULL,'学生守则(Student Rules)','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n<h2>学生守则</h2>\r\n<p>\r\n1. 按时到校上课，不迟到早退。因故需晚到，早退或缺席者，必须由家长事先向老师请假。\r\n</p>\r\n<p>\r\n2. 尊敬老师，遵守课堂纪律。学生须坐在指定的座位。上课时不得在课堂里随便讲话，走动，进出教室，或做其它影响老师上课的事情。上厕所须向老师报告，下课铃响后，要等老师宣布下课后，才可离开教室。如有严重影响课堂秩序者， 如骂人打架，老师有权请其离开教室，送到校务办公室，并通知其家长。情节严重者，学校有权将其停课或开除。\r\n</p>\r\n<p>\r\n3. 按时完成家庭作业，参加学校和老师安排的测验和考试。若因故不能上课，亦须补齐作业。\r\n</p>\r\n<p>\r\n4. 遵守学校制度。不可将任何食品，饮料带进教室，走廊，和其他教学场所。一切饮料食品只限在学校餐厅内享用。\r\n</p>\r\n<p>\r\n5. 爱护学校设施。不得擅自动用，拿走，损坏学校的电脑，教具，墙报，书籍或其它物品。不得进入无人使用的教室。凡损坏学校物品者均须按价赔偿。\r\n</p>\r\n<p>\r\n6. 保持学校环境清洁。不随便扔纸屑或其它垃圾。不得在学校的任何地方乱涂乱写，包括桌，椅，墙，地。没有老师许可,不得在黑板上写字或擦掉别人写的字。\r\n</P>\r\n<p>\r\n7. 衣着整洁。学校将不允许任何人穿内衣进入学校。\r\n</p>\r\n<p>\r\n8. 学校鼓励学生随时向老师或校务组提出意见建议。 \r\n</p>\r\n\r\n','policy','2016-03-03 19:46:20',NULL),(17,NULL,'伯克利华夏中文学校简介','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n<h2>伯克利华夏中文学校简介</h2>\r\n<p>伯克利华夏中文学校位于美国新泽西州中部伯克利高地小镇。该镇在2013年CNN评选的全美最适于居住的50名小镇中位列第六。小镇风景秀丽，交通便利，学区良好，近年来吸引了许多华人来此定居。伯克利华夏中文学校是一个以服务社区为中心、无宗教色彩、政治中立的文化教育组织和一个经济，教学，管理上完全独立的法律实体。本校不附属于任何其它中文学校。学校开设周末普通中文班和CSL（中文第二外语班），教授中国语言与文化；同时还提供丰富的文化、艺术、体育课程来满足学生和家长的不同需求。学校以传承和传播中国文化为己任，致力于为社区的文化多元化做贡献。 在教学理念上，学校以激发学生学习热情为切入点，以学以致用为目标；重点培养学生学习中文的兴趣；努力发展学生应用中文的能力; 学校将在课程安排和教学方法上充分体现这一理念。\r\n </p>\r\n<p>\r\nBerkeley Heights Huaxia Chinese School (BHHXCS) is located in Berkeley Heights, NJ (ranked #6 by CNN/Money in the \"Best Places to Live-America\'s Top 50 Small Towns\"). Many Chinese families are attracted to this town for the friendly neighborhoods, easy commute to New York City and excellent public school system. BHHXCS is a community oriented, non-religious, non-political cultural educational institute. BHHXCS is a totally independent organization and isn\'t affiliated to any other institution. BHHXCS offers weekend Chinese Language Curriculum Class and Chinese Language as a Second Language (CSL) Class.  BHHXCS provides classroom instruction on Chinese language and culture, and also provides a common space for interactions within the Chinese community. BHHXCS strives to succeed in teaching Chinese and  promoting Chinese culture by engaging every student\'s curiosity with its unique educational style. \r\n</p>\r\n\r\n\r\n<p>\r\n联系方式：info@huaxiabh.org</p>\r\n</p>\r\n','notification','2016-03-20 23:00:07',NULL),(18,NULL,'伯克利华夏中文学校成立公告','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n<h2>伯克利华夏中文学校成立公告</h2>\r\n<p>\r\n伯克利华夏中文学校正式成立于2016年2月1日：\r\n</p>\r\n<p>\r\n一、经Berkeley Heights BOE正式批准，学校将租用Columbia Middle School作为校舍。\r\n</p>\r\n<p>\r\n二、学校将于2016年9月份正式开课，周六下午1:30 到5:00开展中文及其它课程的教学。\r\n</p>\r\n<p>\r\n三、学校注册为新泽西非营利机构，是一个具有联邦EIN和NJ税号的独立法律实体。\r\n</p>\r\n<p>\r\n四、学校在经济、教学，管理等各方面都独立运作，跟任何其它学校没有附属关系。\r\n</p>\r\n<p>\r\n五、在海外华裔中文研究和教育领域具有多年教学经验的资深中文教育专家将指导我校教务工作，一批在中文学校具有丰富教学经验的优秀教师已选聘组成学校高水准的教师队伍。\r\n</p>\r\n<p>\r\n六、学校已经与多位从事中国文化研究的教授和其它中文学校的领导达成意向，组成顾问委员会，为学校的高水准建设与持续发展出谋划策。\r\n</p>\r\n\r\n<p>\r\n帮助孩子学习中文，在本地传播中国文化，为本地华人社区服务是学校的宗旨。我们愿意与大家共同努力建设一所高质量的、可持续发展的中文学校。如果您有什么疑问和建议，请随时联系我们。\r\n</p>\r\n','notification','2016-03-28 01:07:38',NULL),(19,'introduction','Introduction','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2>Introduction</h2>\r\n\r\n<p>\r\nBerkeley Heights Huaxia Chinese School (BHHXCS) is located in Berkeley Heights, NJ (ranked #6 by CNN/Money in the \"Best Places to Live-America\'s Top 50 Small Towns\"). Many Chinese families are attracted to this town for the friendly neighborhoods, easy commute to New York City and excellent public school system. BHHXCS is a community oriented, non-religious, non-political cultural educational institute. BHHXCS is a totally independent organization and isn\'t affiliated to any other institution. BHHXCS offers weekend Chinese Language Curriculum Class and Chinese Language as a Second Language (CSL) Class.  BHHXCS provides classroom instruction on Chinese language and culture, and also provides a common space for interactions within the Chinese community. BHHXCS strives to succeed in teaching Chinese and  promoting Chinese culture by engaging every student\'s curiosity with its unique educational style. \r\n</p>\r\n<p>\r\n伯克利华夏中文学校位于美国新泽西州中部伯克利高地小镇。该镇在2013年CNN评选的全美最适于居住的50名小镇中位列第六。小镇风景秀丽，交通便利，学区良好，近年来吸引了许多华人来此定居。伯克利华夏中文学校是一个以服务社区为中心、无宗教色彩、政治中立的文化教育组织和一个经济，教学，管理上都完全独立的法律实体。本校不附属于任何其它中文学校。学校开设周末普通中文班和CSL（中文第二外语班），教授中国语言与文化；同时还提供丰富的文化、艺术、体育课程来满足学生和家长的不同需求。学校以传承和传播中国文化为己任，致力于为社区的文化多元化做贡献。 在教学理念上，学校以激发学生学习热情为切入点，以学以致用为目标；重点培养学生学习中文的兴趣；努力发展学生应用中文的能力; 学校将在课程安排和教学方法上充分体现这一理念。\r\n</p>\r\n\r\n\r\n<p>\r\nEmail：info@huaxiabh.org</p>\r\n','notification','2016-04-02 12:59:16',NULL),(20,'board','School Board of Directors','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2>Board of Directors (2018-2020)</h2>\r\n\r\n<div style=\"align:middle\">\r\n<p>董事长 Chairperson：\r\n                                      <ul>\r\n                                            <li>徐天昕 Mr. Tianxin Xu (6/2019-2020)</li>\r\n                                            <li>刘晖 Ms. Hui Liu (Interim, 1/2019-6/2019)</li>\r\n                                            <li>李青 Ms. Qing Li (2018-1/2019)</li>\r\n                                       </ul>\r\n</p>\r\n<p>秘书长 Secretary ：杨倩 Ms. Qian Yang</p>\r\n<p>董事 Director：方易新 Mr. Yixin Fang (2018-1/2019)</p>\r\n<p>董事 Director：顾敏 Ms. Min Gu</p>\r\n<p>董事 Director：刘晖 Ms. Hui Liu (2018-1/2019)</p>\r\n<p>董事 Director：秦佶 Ms. Ji Qin</p>\r\n<p>董事 Director：王明文 Mr. Mingwen Wang</p>\r\n<p>董事 Director：文诗画 Mr. Shihua Wen</p>\r\n<p>董事 Director：徐天昕 Mr. Tianxin Xu</p>\r\n</div>\r\n\r\n<h2>Board of Directors (2016-2018)</h2>\r\n\r\n<div style=\"align:middle\">\r\n<p>董事长 Chair-Person：王明文 Mingwen Wang</p>\r\n<p>秘书长 Secretary： 刘晖  Hui Liu</p>\r\n<p>董事 Director：张鸿  Hong Zhang</p>\r\n<p>董事 Director：陆征宇  Jenny Lu</p>\r\n<p>董事 Director：徐天昕  Sam Xu</p>\r\n<p>董事 Director：李青  Qing Li</p>\r\n<p>董事 Director：孟欣  Xin Meng</p>\r\n <p>董事 Director：杜升武  Shengwu Du</p>\r\n</div>\r\n','notification','2016-04-02 13:00:14',NULL),(21,'schoolLeadership','School Leadership','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2> School Administrative Committee (SAC)  2019-2020</h2>\r\n<p>校长 Principal： 吴晗 Mr. Han Wu</p>\r\n<p>副校长 Vice Principal：田琰 Ms. Yan Tian, 庄伟 Mr. Wei Zhuang</p>\r\n<p>教务长 Dean：孟欣 Ms. Xin Meng</p>\r\n<p>副教务长 Associate Dean：黄晓燕 Ms. Xiaoyan Huang</p>\r\n<p>财务主管 Accountant： 陆征宇 Ms. Jenny Lu</p>\r\n\r\n<h2> School Administrative Committee (SAC)  2018-2019</h2>\r\n<p>校长 Principal： 徐天昕 Tianxin Xu</p>\r\n<p>副校长 Vice Principal：吴晗 Han Wu, 田琰 Yan Tian, 丁冰 Bing Ding (6/2018-1/2019)</p>\r\n<p>教务长 Dean：孟欣 Xin Meng</p>\r\n<p>副教务长 Associate Dean：黄晓燕 Xiaoyan Huang</p>\r\n<p>财务主管 Accountant： 陆征宇 Jenny Lu</p>\r\n\r\n\r\n<h2>School Administration Committee (2017-2018)</h2>\r\n\r\n<p>校长 Principal： 徐天昕 Tianxin Xu</p>\r\n\r\n<p>副校长 Vice Principal：吴晗 Han Wu, 方易新 Yixin Fang</p>\r\n\r\n<p>教务长 Dean：孟欣 Xin Meng</p>\r\n\r\n<p>财务 Accountant： 陆征宇 Jenny Lu</p>\r\n\r\n<p>副教务长 Associate Dean：熊阳 Sunny Xiong</p>\r\n\r\n<h2>School Administration Committee (2016-2017)</h2>\r\n\r\n<p>校长 Principal： 杜升武 Shengwu Du</p>\r\n\r\n<p>副校长 Vice Principal： 张鸿  Hong Zhang</p>\r\n\r\n<p>教务长 Dean：孟欣 Xin Meng</p>\r\n\r\n<p>财会 Accountant： 陆征宇 Jenny Lu</p>\r\n\r\n<p>校务教务 Officers：熊阳 Sunny Xiong，刘宗元 Peter Liu， 候爱婷 Aiting Hou， 黄晓敏， 陈怡凡， 周晓玲</p>\r\n\r\n<p>\r\n\r\n','notification','2016-04-02 13:01:07',NULL),(25,'High School Students Volunteer Recruitment ','High School Students Volunteer Recruitment ','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n<h2>High school students volunteer recruitment notice</h2>\r\n<p>\r\nCommunity service is a great way for teens to build their skill sets. Volunteer work for teens allows them to expand their horizons and make a difference in their community. Berkeley Heights Huaxia Chinese School (BHHCS) offers teens incredible opportunity to serve your community. Volunteers will help in many aspects of the school, such as assisting teachers and staffs inside and outside the classrooms. BHHCS runs from September to June, Saturday afternoon from 1:30pm to 5:00pm. Volunteer placements are available throughout the year, particularly at the beginning of the school year. Candidates can fill out and submit the following application form.<p>\r\n\r\n<a href=\"https://docs.google.com/forms/d/1e2sXiuxpFW8heRdGLALn9kRfysJYl7XqUzw1GFIfBpo/viewform?from=singlemessage&isappinstalled=0\">Please Click this Link to Apply</a>\r\n</p>\r\n\r\n\r\n<p>\r\n\r\n\r\nThanks for your support！\r\n<p>','notification','2016-04-06 14:21:27',NULL),(28,'2017-2018 School Year Information','School Calendar, Class Schedule & Registration Guideline','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2>BHHXCS 2017-2018 School Year Class Schedule</h2>\r\n<p>\r\n Berkeley Heights HuaXia Chinese School (BHHXCS) is a community-oriented cultural development institution promoting Chinese language and cultural.\r\n</p>\r\n<p>\r\nSchool offers regular Chinese class, CSL (Chinese as Second Language) program, Taichi, Youth Kung Fu, and other art, culture and language programs.\r\n</p>\r\n<p>\r\n<a href=\"https://drive.google.com/open?id=0B8E9IyDma37OWUhKX01CY3BkSWM\">Please Click Here to Review CSL Class Introduction</a>\r\n</p>\r\n\r\n<p>\r\n <a href=\"http://www.huaxiabh.org/Content/documents/BHHXCS%202017-2018%20School%20Calendar%E5%AD%A6%E6%A0%A1%E6%A0%A1%E5%8E%86.pdf\" target=\"_blank\">Please Click Here to Review 2017-2018 School Year Calendar</a>\r\n</p>\r\n\r\n<p>\r\n <a href=\"http://www.huaxiabh.org/Content/documents/BHHXCS%202017-2018%20Course%20Schedule%E8%AF%BE%E7%A8%8B%E8%A1%A8.pdf\" target=\"_blank\">Please Click Here to Review 2017-2018 School Year Full Class List and Schedule</a>\r\n</p>\r\n\r\n\r\n<p>\r\nPlease follow instruction and steps at the bottom of this page to register classes.\r\n</p>\r\n<p>\r\nClassroom Location: Columbia Middle School (BHHXCS uses Columbia classroom)  345 Plainfield Ave, Berkeley Heights, NJ 07922\r\n</p>\r\n<p>\r\nSchool Year: From September to June total 30 weekends\r\n</p>\r\n<p>\r\nTime: Saturday from 1:30pm to 5:00pm\r\n</p>\r\n<p>\r\nRegistration Period: From April to next January\r\n</p>\r\n<p>\r\nMail Address: 364 Springfield Ave #539\r\n         Berkeley Heights, NJ 07922\r\n</p>\r\n<p>\r\nPhone: 908-312-0168\r\n</p>\r\n<p>\r\nEmail: info@huaxiabh.org。\r\n</p>','notification_archived','2016-04-07 01:53:29',NULL),(29,'文化课注册报名优先顺序安排','关于文化课注册报名优先顺序安排的提示','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2>伯克利华夏中文学校关于文化课注册报名优先顺序安排的提示</h2>\r\n\r\n<p>鉴于文化课名额有限，为了公平起见，学校将按照如下方案来确定学生报名的优先顺序：\r\n </p>\r\n<p>\r\n1) 系统打印出的注册报名时间为第一优先顺序，但是必须在注册后两个星期以内提交选课单和支票。\r\n</p>\r\n\r\n<p>\r\n2）如果系统内注册时间一致，学校将按照支票寄出时间来安排先后(by postmark).\r\n</p>\r\n<p>\r\n当文化课报名人数超过额度时，系统会显示一个warning message，家长在选这门课时会看到。这并不代表你就没有可能注册这门课，你应该把课程选好后尽快提交选课单和支票，学校会在收到支票后的两周内通知你的注册情况。\r\n</p>\r\n<p>\r\n如果你在选这门文化课时没有看到warning message， 又在选课后两个星期交了打印的选课单和支票，你应该可以很有把握这门课已经注册上，学校也会在收到支票后的两周内给你发email 来confirm。\r\n</p>\r\n\r\n<p>\r\n如果因为优先顺序的原因你被放在waiting-list，学校会给你发email通知，也会建议你考虑换一门还没有注满的文化课。\r\n</p>\r\n\r\n<p>\r\n文化课的注册不会影响中文课的注册，中文课没有名额限制。很多华夏的中文老师一直跟学校保持联系，中文课将以小班为主，注册学生多了学校可以再联系有经验的华夏老教师开班。\r\n</p>\r\n<p>\r\n有些文化课可能会很快接近额度，希望大家尽早决定，尽早报名。\r\n</p>\r\n<p>\r\n友情提示：网上选课只能hold two weeks, 两个星期如果你没有提交选课单和支票，学校注册系统有可能会把你的选课注销。\r\n\r\n<p>\r\n','notification','2016-04-07 13:10:55',NULL),(30,'高中生义工招聘','High School Volunteers 伯克利华夏中文学校高中生义工招聘公告','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n<h2>伯克利华夏中文学校高中生义工招聘公告 Call for high school volunteers!</h2>\r\n<p>\r\n学校目前已经组建了一个由资深华夏老师带领的优秀的中文教师团队，同时也聘请了在专业领域有名望有造诣的文化课老师来丰富学校的文化课程。为了配合这些老师的教学工作，让学校的教务教学能更加有效有序的进行，学校决定向其它兄弟学校学习，实行高中生义工制度，在每个教室安排一到两个高中生义工做助教。这些高中生将是学校挑选出来的优秀年轻人，他们是我们社区的未来，也是我们家长的骄傲。<p>\r\n<p> \r\n高中生义工制度不仅对中文学校的教学有很大的支持，也给了我们的年轻人一个锻炼提高的的机会，培养他们参与社区服务的意识，对他们的成长发展是一个很好的帮助。希望广大家长向大孩子宣传，鼓励他们来报名。 </p>\r\n<p>\r\n作为中文学校老师的助手,高中生义工不仅可以帮助低年级小朋友, 获得中文教学的经验, 还可锻炼领导和管理能力,获取相应的 ACS, SSLhours。我们热切希望有兴趣的高中生报名参加。中文学校的运行离不开高中生义工的参与,他们将在教室内协助老师教学及维持秩序,在教室外帮助学校教务维持中文学校正常运作,课后检查教室,恢复到使用之前的状态等。学校的上课时间为周六下午。有兴趣的同学请直接填写下面的报名表：\r\n</p>\r\n<p>\r\n<a href=\"https://docs.google.com/forms/d/1e2sXiuxpFW8heRdGLALn9kRfysJYl7XqUzw1GFIfBpo/viewform?from=singlemessage&isappinstalled=0\">Please Click this Link to Apply High School Volunteers</a>\r\n</p>\r\n谢谢大家的支持！\r\n<p>\r\n\r\n','notification','2016-04-07 13:11:46',NULL),(31,'注册公告','2018-2019 Registration 注册公告','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n<span style=\"align:center\"><h2>2018-2019学年注册公告 2018-2019 School Year Registration</h2></span>\r\n<p>\r\n各位家长朋友们好！作为立足华人社区的501(c)(3)非营利组织, 经过两年的发展，我们学校已经组建了一支由华夏资深教师带领的优秀中文教师队伍，逐步充实了由名望极高的文化课老师教授的丰富多彩的文化课程。牢记著名钢琴家和联合国和平使者郎朗先生的衷心祝福和殷切希望 “祝愿华夏中文学校越办越好！把中华文化发扬光大！”，九年级毕业班8位同学全部以优异成绩（八位同学中值分数253，注：HSK合格分180）通过汉考HSK四级和五级。北京召开的“第四届世界华文教育大会”上，我校黄镁老师 （学前小班和少年中文补习班），和邵天毅（三年级和九年级）老师获得了由国侨办和海外交流协会颁发的“海外华文教师优秀奖” 。本学年我校首次组队陆续参加了华夏总校的智力运动会，演讲比赛以及辩论赛等大赛，均斩获佳绩，同学们获取了丰富和宝贵的大赛经验和锻炼。</p>\r\n<p>\r\n在与海外中文教育专家的长期探讨和同家长的深度沟通中，学校在努力逐步完善适合自身发展，富有自己特色的教学方案和教学理念（<a href=\"https://drive.google.com/open?id=0B8E9IyDma37Ob3NqNzZWS2JfWTQ\"><font color=\"blue\">中文课教学特点介绍</font></a>)，同时也选择了国务院侨办组织编写的《中文》作为我们普通中文课教材（<a href=\"http://www.hwjyw.com/textbooks/downloads/zhongwen/\"><font color=\"blue\">点击下载</font></a>)。学校的教学器材及各项教学组织保障工作也都已经稳定。 \r\n<p>\r\n伯克利华夏中文学校2018-2019学年注册选课具体通告如下：\r\n</p>\r\n<p>\r\n详情请参考 <span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"http://www.huaxiabh.org/Content/documents/BHHXCS%202018-2019%20%E6%B3%A8%E5%86%8C%E9%A1%BB%E7%9F%A5.pdf\" target=\"_blank\">注册须知中文版</a></span> || <span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"http://www.huaxiabh.org/Content/documents/BHHXCS%202018-2019%20Registration%20Guidelines.pdf\" target=\"_blank\">Registration Guidelines</a></span> ||\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/spreadsheets/d/1w19HPuifFGIuRKWrajpMcTsDeQHq2b0B9WSKqVEDV8w/edit?usp=sharing\" target=\"_blank\">课程列表Course Catalog</a></span> ||\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/file/d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\">中文课详细介绍 Course Descriptions for Chinese Classes</a></span> \r\n</p>\r\n<p>\r\n 1. 学生注册将以家庭为单位，每个家庭需要建立自己的单独账户。<span style=\"font-weight:bold; color:red;\"><del>截至6月2日前注册的家庭享受免$50注册费的优惠</del><ins>expired</ins></span>\r\n</p>\r\n<p>\r\n2. 中文课涵盖学前小班，学前大班，一年级至九年级，CSL 以及中文补习班等。参考调查问卷，应大家的强烈要求，<span style=\"font-weight:bold; color:red;\">2018-2019学年新增设课程</span>如下 (具体课程简介和注册要求参看上边链接):\r\n<ul>\r\n<li>\r\n中文AP (10th Grade and higher, passed HSK4)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1KoaRkBHYyv8eRG24VoLZz8l5x_ssPKj2/view?usp=sharing\" target=\"_blank\">书法+国画 Chinese Calligraphy&Painting</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1xG_1OJ6s4BftmQq8ElPdIUdO_we-xJJX/view?usp=sharing\" target=\"_blank\">唱游班 Kids Singing& Dancing</a>(3-6岁)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1SAHQdyM9AwHcDtgy47cDQaLdhwbZSQ6H/view?usp=sharing\" target=\"_blank\">舞蹈 Dancing</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/17sKobRAnksKlb_aTQLCQzd8jjdoVJqk2/view?usp=sharing\" target=\"_blank\">英文写作/辩论(暂定7-9年级) English Essay&Debate 7th-9th Grade</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1ZrXceSgelH6NqgjFR9m8byf-BztBZaz-/view?usp=sharing\" target=\"_blank\">中文写作/翻译 Chinese Essay/Translation</a>(1-3年级)</li>\r\n<li><a href=\"https://drive.google.com/file/d/10Byc4ntCc8X8BPGr-ihkgU99IKpa2z3h/view?usp=sharing\" target=\"_blank\">瑜伽(成人) Yoga</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/18c2zo_BlmXTReMArRlFCjdTUBOXwCUIW/view?usp=sharing\" target=\"_blank\">服装缝制工艺课 Sewing and Tailoring Technique</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Highly recommend!</span></li>\r\n<li><a href=\"https://drive.google.com/file/d/1uqxS4_HcN4qKdLDzY2_z-IMrJwGZadj8/view?usp=sharing\" target=\"_blank\">国际象棋 Chess</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Highly recommend!</span></li>\r\n</ul>\r\n\r\n继续开设以下现有文化课:\r\n<ul>\r\n<li><a href=\"https://drive.google.com/file/d/1pEJRDVIKv9C3XbrPC9DQiVIUQC9RzcNt/view?usp=sharing\" target=\"_blank\">俞氏数学 Yu\'s Math</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1BLdgLeBFeX2vEPOR8qdSYur3EtQrvqTN/view?usp=sharing\" target=\"_blank\">美术绘画 Drawing Art </a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1X1QAyraxlCWi-z8Lqy3WELbrC8c9KULA/view?usp=sharing\" target=\"_blank\">少儿武术Youth Kung fu (Chinese martial arts)</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1imy91ZF630oZ-oK5J8khgNX7z_UcElmo/view?usp=sharing\" target=\"_blank\"><del>太极成人班 Tai Chi</del></a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1PmWuY601fXoun-43QPSwcvCUuHPfDrbz/view?usp=sharing\" target=\"_blank\"><del>中国历史与文化 Chinese History and Culture</del></a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1HJ1hSzRVEk0i01qCMBzul5PaF-gsgGfy/view?usp=sharing\" target=\"_blank\"><del>手工Art & Craft</del></a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Ww82auigIImIW28NLzDBtRuft2G5PZZU/view?usp=sharing\" target=\"_blank\">围棋 Youth Go</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Q8obUc60WPJX0x5Tm6meozycWcubOQ_e/view?usp=sharing\" target=\"_blank\">ESL英语成人班</a>(面向新移民和探亲父母等)</li>\r\n</ul>\r\n欢迎大家踊跃报名, 家长可以先根据兴趣报名，我们会根据报名人数的多少来调整课程时间，谢谢家长的理解和配合 :) The Course Schedule will be finalized in late August according to the the enrollment of the classes.\r\n</p>\r\n<p>\r\n3. 经Berkeley Heights BOE正式批准，学校继续租用Columbia Middle School作为校舍，2018年9月份开学，周六下午1:30 到5:00开展中文及其它课程的教学。\r\n</p>\r\n<p>\r\n4. 请先浏览上边链接的课程介绍(包括老师介绍），上课时间，注册规定等其它相关文件和规章。明确你要注册的课程，同时也了解相关收费标准，退学政策，注册政策，以及学校的其它有关规章。\r\n</p>\r\n<p>\r\n 5. 具体注册步骤请参照上面的<span style=\"font-weight:bold;color:bold;\"><a href=\"http://www.huaxiabh.org/Content/documents/BHHXCS%202018-2019%20%E6%B3%A8%E5%86%8C%E9%A1%BB%E7%9F%A5.pdf\" target=\"_blank\">注册须知</a></span>   <span style=\"font-weight:bold;color:bold;\"><a href=\"http://www.huaxiabh.org/Content/documents/BHHXCS%202018-2019%20Registration%20Guidelines.pdf\" target=\"_blank\">(English version)</a></span> 。完成网络注册后请在两个星期内邮寄(或周六上课时间到校drop off)选课单和支票给学校。学校在收到付款后会在系统里确认注册成功。\r\n</p>\r\n<p>\r\n6. 有些文化课很受欢迎可能会比较快报满，请尽快注册。如果课程报名学生过多，学校将按照报名先后的顺序来安排。\r\n</p>\r\n<p>\r\n7. 文化课的注册不会影响中文课的注册，中文课没有名额限制。很多华夏的中文老师一直跟学校保持联系，中文课将以小班为主，注册学生多了学校可以联系有经验的华夏老教师再开班。\r\n</p>\r\n<p>\r\n8. 为了系统安全，在你建立login后，系统会自动发confirm email到你提供的邮箱，你需要点击confirm来确认。我们的confirm email可能会被转到你邮箱的spam folder，请注意查收。\r\n</p>\r\n\r\n<p>\r\n帮助孩子学习中文，在本地传播中国文化，为本地华人社区服务是学校的宗旨。我们愿意与大家共同努力建设一所高质量的、可持续发展的中文学校。如果您对学校工作有什么疑问和建议，请随时联系我们。\r\n\r\n</p>\r\n','notification_archived','2016-04-07 13:12:29',NULL),(32,'家长见面会','伯克利华夏中文学校家长见面会','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2>伯克利华夏中文学校家长见面会</h2>\r\n<p>\r\n美丽的春天正沐浴着伯克利高地这个坐落在新泽西中部的小镇，清爽的春风轻拂着发了新芽的枝头，处处花香鸟语，让人心旷神怡。就在这个春暖花开的四月，新成立的伯克利华夏中文学校（Berkeley Heights Huaxia Chinese School）于2日下午3时在当地的中学大礼堂迎来了来自本地及周边社区的近两百名家长和学生。家长见面会气氛热烈而祥和，校方和家长们坐在一起就中文学校的办学理念、教学质量、课程安排以及学校的未来发展进行了充分详尽的探讨与交流。本次会议给了双方一个非常好的面对面交流机会，既让家长深入的了解学校的现况，也让学校更加明确了家长的需求。<p>\r\n<p> \r\n在见面会上，校长杜升武先生首先详细介绍了学校的教务教学计划和中文课文化课的课程设计安排，同时也阐明了学校的机构设置、运作机制以及将来的发展定位。董事长王明文先生接着介绍了董事会的结构分工，募捐和捐赠工作的开展，以及学校与社区协调发展方面的有关事宜，同时也表示非常希望广大家长积极参与学校志愿者工作，为建设一个高质量的可持续发展的社区周末中文学校共同努力。参加见面会的家长都非常欣慰的看到自己的社区有一个欣欣向荣的中文学校，也为中华文化能够在本地得到广泛传播而自豪。中国经济的不断发展和中华文化的博大精深让每一个移民家庭都深深地感觉到应该让孩子学习我们自己的母语，继承我们的优秀文化，长大后孩子可以连接中西，开拓视野，为事业发展提供更多的机会。到场的每位家长都表示希望自己的孩子在学校有经验，有耐心和热爱中文教学的老师的带领下学好中文；学校也强调了培养孩子学习中文的兴趣的重要性，希望能通过设计一些特别的文化课给孩子更多的机会来了解中国的文化和历史。会上家长们询问了很多选课方面的问题，也对学校开设的一些文化课表示了特别的兴趣，例如中国历史文化课，武术课，网球课和数学提高班等。 </p>\r\n<p>\r\n历时两个小时家长会圆满结束了，参加会议的每位家长都非常满意这次见面会的安排，深深的体验到了学校和社区和谐发展的良好气氛。他们纷纷表示很高兴见到学校的负责人、老师和志愿者，感受到了他们为传承中华文化所做出的不懈努力，感谢他们为社区兢兢业业，不求回报的无偿服务，也为他们精心安排各样课程的敬业精神点赞。\r\n</p>\r\n<p>\r\n鉴于有些家长由于时间关系没有来参加家长见面会，我们特把学校的presentation 给大家分享一下，请点击下面的链接来获取。\r\n</p>\r\n<p>\r\n<a href=\"https://drive.google.com/file/d/0B8GkbQ8_vZjcaVVFR21FRGFSVm8/view?usp=sharing\">Please Click this Link to Review  the Presentation</a>\r\n</p>\r\n谢谢大家的支持！\r\n<p>\r\n','notification_archived','2016-04-07 13:13:08',NULL),(33,'waive','免责声明(Release of Liability Statement)','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2>Release of Liability Statement:</h2>\r\n<p>\r\n1. In consideration of the activities at the Columbia Middle School, 345 Plainfield AveBerkeley Heights, NJ, sponsored by Berkeley Heights Huaxia Chinese School, a nonprofit organization, the School or its officials, teachers or volunteers will not be held responsible for any injury or accident sustained by the member of our party, or for the loss of or to any property belonging to a member of our party or anyone else.\r\n</p>\r\n<p>\r\n2. In the course of conducting school activities, the school will be seeking media coverage and involvement that may include Web Site text and images, and possibly Newspapers and Television. The photo, name, and school work of the member of our party may be included in the media as noted above.\r\n</p>\r\n\r\n\r\n<p>','policy','2016-04-21 04:14:53',NULL),(34,'中文课教学特点','伯克利华夏中文学校中文课教学特点介绍','\r\n\r\n<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n<h2>伯克利华夏中文学校中文课教学特点介绍</h2>\r\n<p>\r\n在同华夏资深教师和海外中文教育顾问深度探讨的基础上，学校制定了具有自身特色的教学理念，教学方法，课程安排，以及教案设计。为了让广大家长更好的了解我们的中文教学特点，也更加深入地认识学校的中文教学理念和教学方法，特此向大家提纲挈领的介绍一下学校在中文课教学设计上的一些特点：\r\n</p>\r\n\r\n<p>\r\n一、教学理念：以激发学生学习热情为切入点，以学以致用为目标；重点培养学生学习中文的兴趣；努力发展学生应用中文的能力。学校将在课程安排和教学方法上充分体现这一理念。\r\n</p>\r\n<p>\r\n二、教材选择：在经过与中文教育专家的探讨和同家长的深度沟通后，学校决定使用国务院侨办组织编写的《中文》作为教材。这套教材设计新颖，题材丰富，非常适合周末海外中文教育；同时它也具备多媒体教学功能。很多海外中文教育专家非常推崇这套教材；不少华夏中文学校都在应用或转换到这套教材。\r\n</p>\r\n<p>\r\n《中文》教材根据《汉语水平等级标准与语法等级大纲》、《汉语水平词汇与汉字等级大纲》 等科学地安排教材的字、词、句、篇章等内容，由浅入深、循序渐进地设置教学内容和家庭练习 。学生经过全套《中文》教材的学习与训练，将具备中文听、说、读、写的能力。 <a href=\"http://www.hwjyw.com/textbooks/downloads/zhongwen/\">请点击下载中文教材。</a>\r\n</p>\r\n<p>\r\n三、教学安排：学生从学前班到十年级系统学习《中文》这套教材，按照其它兄弟学校的设计模式，我校学生九年级时将要求通过HSK四级考试，十年级要求通过中文AP考试。\r\n</p>\r\n<p>\r\n四、教学方法：以苏格拉底的启发式教学替代传统的填压式教学；学校要求老师多向学生提问，鼓励学生参与和发言。老师每堂课要设计跟课程结合密切的小游戏让学生多读多说多写中文。根据教学内容补充一些顺口溜、儿童诗，猜谜语，造句子这类的小游戏可以提高学生的参与度，增加他们的学习兴趣。高年级的中文班还会补充写故事，讲笑话，做情景剧表演等游戏，让学生能在活跃的气氛中充分掌握并应用所学的内容。\r\n</p>\r\n<p>\r\n五、课堂安排：学生实施高中生义工制度，每个教室将安排一到两个高中生助教来配合老师的教学。学校对老师和义工要求在课堂上平等对待每个学生，不能有任何形式的歧视，不能根据学生学习好坏来对待学生。学校秉承no-child-left-behind的宗旨，努力帮助每个学生学习中文。\r\n</p>\r\n<p>\r\n六、教师要求：学校已经聘请了一批有经验的华夏资深老师。学校将根据自身教学特点对老师进行统一培训。我们学校的老师都是对中文学校，对海外儿童中文教育充满热爱与热情的高学历人才。学校要求老师的课前教师要求认真备课，编写教案，并根据学生的具体情况制定学习重点，设计课堂小测验和小游戏。课后教师要把教学内容及作业分发给学生，同时跟家长保持良好沟通和合作，一起帮助学生学好中文。\r\n</p>\r\n\r\n<p>\r\n帮助孩子学习中文，在本地传播中国文化，为本地华人社区服务是学校的宗旨。我们愿意与大家共同努力建设一所高质量的、可持续发展的中文学校。如果您对学校工作有什么疑问和建议，请随时联系我们。\r\n</p>\r\n\r\n\r\n\r\n','notification','2016-04-23 05:57:10',NULL),(35,'books','中文图书馆图书征集通告','<p>\r\n亲爱的朋友们：\r\n</p>\r\n<p>\r\n书是学习语言的强大载体和不可缺少的朋友，书是孩子们了解自然、认识社会、学习生活的窗口。好的书籍，能影响一个人的一生。孩子们需要优秀的书籍来了解中国伟大的历史和文化。每一位爱书人都希望自己的图书能在一双又一双求知的眼睛里传播力量，而不是在箱底蒙尘。为了让Berkeley Heights中文学校的孩子们阅读到更多的优秀书目，也能让孩子看过的书得到再次利用，我们学校董事会决定创建中文图书馆并在家长范围内开展图书捐赠活动。家长同胞们请行动起来将那些闲置的、图书、报刊、音像和影视制品(所有捐赠都可以免税)收集起来；共同丰富、充实中文学校的书库。献出一本书，传递一份爱！成就一个梦想！我们希望学校家长和子女都参与到项目中来，享受与人为善的快乐。我们会组织志愿者编辑整理图书，并进行分类管理，孩子们可以在星期六上课的时候取到感兴趣的中文书，定期更换。相信您的每一点付出都将是对中文学校的莫大帮助！衷心感谢您的参与！您的一点行动可以使更多人欣赏、受益。\r\n</p>\r\n<p>\r\n附：捐书要求：\r\n</p>\r\n<p>\r\n1.     以自愿的形式开展，仅接受中文图书、报刊、音像和影视制品捐赠。\r\n</p>\r\n<p>\r\n2.     内容健康活泼、积极向上，适合少年儿童阅读为主。新书、旧书均可。\r\n</p>\r\n<p>\r\n3.     所捐书籍完好、干净、整洁，没有撕毁、缺页。 \r\n</p>\r\n<p>\r\n4.     如有针对外国人学汉语等方面的图书或有针对教师业务方面图书也欢迎.\r\n</p>\r\n<p>\r\n5.     本捐赠活动长期进行。\r\n</p>\r\n<p>\r\n如果您想捐赠书籍给中文学校图书馆，请email联系：info@huaxiabh.org','notification','2016-06-02 23:46:45',NULL),(36,'Notice Of Nondiscriminatory Policy ','非歧视政策(Notice Of Nondiscriminatory Policy) ','<h2>\r\nNOTICE OF NONDISCRIMINATORY POLICY AS TO STUDENTS\r\n</h2>\r\n\r\n<p>\r\n\r\nThe Berkeley Heights Huaxia Chinese School admits students of any race, color, national and ethnic origin all the rights, privileges, programs, and activities generally accorded or made available to students at the school. It does not discriminate on the basis of race, color, national and ethnic origin in administration of its educational policies, admissions policies, scholarship and loan programs, and athletic and other school-administered programs. \r\n\r\n</p>\r\n\r\n','policy','2016-06-17 02:06:58',NULL),(37,'培训会短讯','伯克利华夏中文学校首次教师培训会短讯','\r\n<h2>*****伯克利华夏中文学校首次教师培训会短讯*****</h2>\r\n</p>\r\n<p>\r\n伯克利华夏中文学校首次教师培训会于2016年6月25日在Berkeley Heights图书馆举行。由学校精心挑选组建的第一批教师队伍首次跟学校工作管理人员欢聚在了一起共同讨论如何努力建设高质量的，可持续发展的， 为本地社区服务的中文学校。会上学校董事会和校委会成员热烈欢迎首批教师成员的加盟，向他们介绍了学校的创建过程，机构性质和管理特点，同时也强调了学校的教学理念，教学要求和教师守则。教师们也都做了自我介绍，表达了对中文教育的无比的热爱和对伯克利华夏中文学校激扬的激情。\r\n</p>\r\n<p>\r\n培训会由三位华夏资深中文教育专家向大家系统介绍如何提高中文教学质量，活跃中文课堂气氛，培养学生学习兴趣。首先是伯克利华夏中文学校教学顾问，原华夏Livingston的教务长，海外中文教育专家和大学教授李平老师给大家系统地介绍了海外周末中文教育的教学特点，HSK和AP考试的准备安排，中文课程教案的设计编写等主题。李老师高屋建瓴由浅入深把她这么多年来对海外中文教育的研究经验毫无保留地介绍给了大家，让我们的老师对海外中文教育有了一个系统深刻的认识。\r\n</p>\r\n<p>\r\n接下来华夏Livingston的现任教务长游牧老师非常生动的向大家讲授了如何有效提高学生学习中文兴趣，活跃课堂气氛，实现寓教于乐。游牧老师目前在高中教授ＣＳＬ，对海外中文教育有十几年的研究和实践，形成了一套独特的非常适合美国文化的中文教学理念和方法。游老师结合讲案例和做游戏的形式给我们的老师上了一堂栩栩如生的海外中文教育课。老师们通过参与她设计的案例和游戏非常有效的学习了海外中文教育的特点，也真正理解了寓教于乐在中文学校的应用。\r\n</p>\r\n<p>\r\n最后我们学校的邵天毅老师就如何有效提高课堂管理和增加学生参与课堂教学做了主题介绍。邵老师是名校教育科班出身，在华夏中文学校有很多年的教学经验，对周末中文教学，中文课堂的管理和与学生建立良好有效的关系有自己独特的研究和见解。中文学校的家长和学生对邵老师的为人和教学都表示深深的赞许。她以理论结合实际，通过分析个案的方式给老师们详细介绍了提高中文教学和课堂管理的方式方法。老师们都希望在以后的教学过程中能同邵老师多交流和学习。\r\n</p>\r\n<p>\r\n为期一天的教师培训会在意尤未尽的感觉中结束了，老师们都感到这次教师培训会内容丰富，形式活泼；大家都受益匪浅。学校教务处把中文课教师备课材料也发给了各位老师。大家都积极表示将利用暑假时间好好备课，为２０１６－２０１７学年做足功课。伯克利华夏中文学校的所有工作人员也都为学校的第一个学年做好了充分的准备，期盼与老师们精诚合作一起开创学校的美好未来。\r\n</p>\r\n<p>\r\n<a href=\"https://drive.google.com/folderview?id=0BxnijtZx3ng1MHdRS2ZJSTFBNkU&usp=sharing\">Please click here to view the pictures from our teacher conference</a>','notification','2016-06-27 20:59:29',NULL),(38,'advisor','NOTICE OF NONDISCRIMINATORY POLICY AS TO STUDENTS','<h2>\r\nNOTICE OF NONDISCRIMINATORY POLICY AS TO STUDENTS\r\n</h2>\r\n<p>\r\nThe Berkeley Heights Huaxia Chinese School admits students of any race, color, national and ethnic origin all the rights, privileges, programs, and activities generally accorded or made available to students at the school. It does not discriminate on the basis of race, color, national and ethnic origin in administration of its educational policies, admissions policies, scholarship and loan programs, and athletic and other school-administered programs. \r\n</p>','notification','2016-09-03 00:57:14',NULL),(39,'课程表和课程介绍','伯克利华夏中文学校2016-2017学年课程表和课程介绍','\r\n\r\n<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2>伯克利华夏中文学校2016-2017学年课程表和主要课程介绍</h2>\r\n<p>\r\n一、普通中文课\r\n</p>\r\n<p>\r\n学校已经组建了一支由华夏资深教师带领的优秀中文教师队伍，经过与中文教育专家的探讨和同家长的深度沟通，学校已经决定使用国务院侨办组织编写的《中文》作为普通中文课教材；学校还同华夏资深教师和海外中文教育顾问合作制定了具有自身特色的教学理念，教学方法，课程安排，以及教案设计。请通过下面的连接来了解我们的课程安排和教学特色。\r\n</p>\r\n<p>\r\n <a href=\"http://www.hwjyw.com/textbooks/downloads/zhongwen/\">请点击下载中文教材(学校会发教材）</a>\r\n</p>\r\n</p>\r\n\r\n<p>\r\n <a href=\"https://drive.google.com/open?id=0B8E9IyDma37Ob3NqNzZWS2JfWTQ\">请点击下载伯克利华夏中文学校中文课教学特点介绍</a>\r\n</p>\r\n\r\n<p>\r\n <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OSzE2blQ0R3g1X0E\">请点击下载伯克利华夏中文学校2016-2017学年课程表</a>\r\n</p>\r\n\r\n<p>\r\n <a href=\"https://drive.google.com/open?id=0B8E9IyDma37ORnhfMlFXeER6aFk\">请点击下载伯克利华夏中文学校中文课程详细介绍</a>\r\n</p>\r\n\r\n<p>\r\n <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OZ3hfb1lDU2pHdVE\">请点击下载伯克利华夏中文学校2016-2017 School Year Calendar</a>\r\n</p>\r\n\r\n\r\n<p> \r\n二、文化课和其它主要相关课程：学校聘请了在专业领域有名望有造诣的文化课老师来丰富学校的文化课程，请点击课程名称来下载课程介绍。\r\n </p>\r\n<p>\r\n<a href=\"https://drive.google.com/open?id=0B8E9IyDma37OX3pBaC01ZS1fdTA\">少年中文补习班</a>，  <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OWUhKX01CY3BkSWM\">CSL双语班</a>，  <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OMGs0ZjhrbG5PUU0\">中国历史文化班</a> ， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OUFZSNDhsYTQ0dnc\">成人英语班</a>， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OYVlqLWJxWE9yZmM\">数学提高班</a> ， \r\n<a href=\"https://drive.google.com/open?id=0B8E9IyDma37OM0xUdzhMSmQ1NGs\">声乐班</a> ，\r\n<a href=\"https://drive.google.com/open?id=0B8E9IyDma37ObFVrVWpCdE4zdXc\">舞蹈班</a>\r\n</p>\r\n\r\n<p>\r\n<a href=\"https://drive.google.com/open?id=0B8E9IyDma37OejZiOWVBY0dtRms\">手工班</a>， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OWGxXZGtxYV9aaGs\">绘画班</a>， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37ON0NNeXFqMzZ6N0U\">武术班</a>， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OOFMyRzJHUno5Ums\">成人瑜伽班</a>， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OS0pla1o3bHhxM1k\">网球班</a>， \r\n<a href=\"https://drive.google.com/open?id=0B8E9IyDma37OTUxPTFlzRlhKU28\">儿童歌咏班</a>\r\n</p>\r\n\r\n\r\n\r\n</p>\r\n友情提示：在开学后两周内退课学校可以退学费。有些文化课很受欢迎可能会比较快报满，请大家尽快注册。如果课程报名学生过多，学校将按照报名先后的顺序来安排。文化课的注册不会影响中文课的注册，中文课没有名额限制。很多华夏的中文老师一直跟学校保持联系，中文课将以小班为主，注册学生多了学校可以联系有经验的华夏老教师再开班。谢谢大家的支持！\r\n<p>\r\n\r\n<p>','notification_archived','2016-09-05 03:33:14',NULL),(40,'课程表和课程介绍','伯克利华夏中文学校2017-2018学年课程表和课程介绍','<h2>2017-2018学年课程表和主要课程介绍</h2>\r\n<p>\r\n<strong>一、普通中文课</strong>\r\n</p>\r\n\r\n<p>\r\n学校组建了一支由华夏资深教师带领的优秀中文教师队伍，通过与中文教育专家的探讨和同家长的深度沟通，学校决定使用国务院侨办组织编写的《中文》作为普通中文课教材；学校还同华夏资深教师和海外中文教育顾问合作制定了具有自身特色的教学理念，教学方法，课程安排，以及教案设计。请通过下面的连接来了解我们的课程安排和教学特色。\r\n</p>\r\n\r\n<p>\r\n <a href=\"http://www.huaxiabh.org/Content/documents/BHHXCS%202017-2018%20School%20Calendar%E5%AD%A6%E6%A0%A1%E6%A0%A1%E5%8E%86.pdf\" target=\"_blank\">2017-2018 学校校历 School Year Calendar</a>\r\n</p>\r\n\r\n<p>\r\n <a href=\"http://www.huaxiabh.org/Content/documents/BHHXCS%202017-2018%20Course%20Schedule%E8%AF%BE%E7%A8%8B%E8%A1%A8.pdf\" target=\"_blank\">2017-2018学年课程表 Course Schedule</a>\r\n</p>\r\n\r\n<p>\r\n <a href=\"http://www.hwjyw.com/textbooks/downloads/zhongwen/\" target=\"_blank\">请点击下载中文教材(学校会发教材）</a>\r\n</p>\r\n\r\n<p>\r\n <a href=\"https://drive.google.com/open?id=0B8E9IyDma37Ob3NqNzZWS2JfWTQ\" target=\"_blank\">中文课教学特点介绍</a>\r\n</p>\r\n\r\n<p>\r\n <a href=\"https://drive.google.com/open?id=0B8E9IyDma37ORnhfMlFXeER6aFk\" target=\"_blank\">中文课程详细介绍</a>\r\n</p>\r\n\r\n\r\n<p> \r\n<strong>二、文化课和其它主要相关课程：学校聘请了在专业领域有名望有造诣的文化课老师来丰富学校的文化课程，请点击课程名称来下载课程介绍。</strong>\r\n </p>\r\n<p>\r\n<a href=\"https://drive.google.com/open?id=0B8E9IyDma37OX3pBaC01ZS1fdTA\" target=\"_blank\">少年中文补习班</a>，  <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OWUhKX01CY3BkSWM\" target=\"_blank\">CSL双语班</a>，  <a href=\"http://www.huaxiabh.org/Content/documents/course/%E6%96%87%E5%AD%A6%E8%89%BA%E6%9C%AF%E4%B8%AD%E7%9A%84%E4%B8%AD%E5%9B%BD%E5%8E%86%E5%8F%B2%E4%B8%8E%E6%96%87%E5%8C%96Chinese%20History%20and%20Culture.pdf\" target=\"_blank\">文学艺术中的中国历史与文化</a> ， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OUFZSNDhsYTQ0dnc\" target=\"_blank\">成人英语班ESL</a>，  \r\n\r\n</p>\r\n\r\n<p>\r\n<a href=\"http://www.huaxiabh.org/Content/documents/course/%E4%B9%A6%E6%B3%95%E7%8F%ADChinese%20Calligraphy.pdf\" target=\"_blank\">书法班</a>，\r\n <a href=\"http://www.huaxiabh.org/Content/documents/course/%E4%BF%9E%E6%B0%8F%E6%95%B0%E5%AD%A6%20Yu\'s%20Math.pdf\" target=\"_blank\">俞氏数学</a>，\r\n<a href=\"https://drive.google.com/open?id=0B8E9IyDma37OejZiOWVBY0dtRms\" target=\"_blank\">手工班</a>， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OWGxXZGtxYV9aaGs\" target=\"_blank\">绘画班</a>， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37ON0NNeXFqMzZ6N0U\" target=\"_blank\">武术班</a>\r\n</p>\r\n\r\n\r\n\r\n</p>\r\n友情提示：在开学后两周内退课学校可以退学费。有些文化课很受欢迎可能会比较快报满，请大家尽快注册。如果课程报名学生过多，学校将按照报名先后的顺序来安排。文化课的注册不会影响中文课的注册，中文课没有名额限制。很多华夏的中文老师一直跟学校保持联系，中文课将以小班为主，注册学生多了学校可以联系有经验的华夏老教师再开班。谢谢大家的支持！\r\n<p>\r\n\r\n<p>','notification_archived','2017-08-24 19:31:51',NULL),(41,'伯克利华夏中文学校特聘洪利武律师为法律顾问','伯克利华夏中文学校特聘洪利武律师为法律顾问','<p>\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<h2>学校法律顾问</h2>\r\n\r\n<p> \r\n伯克利华夏中文学校荣幸特聘洪利武律师为学校法律顾问，为学校提供法律问题上的咨询服务。校方非常感谢洪律师对伯克利中文学校以及周边社区的热心支持。\r\n</p>\r\n\r\n<p> \r\n<a href=\"https://drive.google.com/open?id=0B_-B0Nsgf8kFYUlHNEdRaWtrejQ\">伯克利华夏中文学校律师顾问聘书</a>\r\n</p>','notification','2017-08-30 03:01:38',NULL),(42,'伯克利华夏中文学校正式加盟华夏中文学校','伯克利华夏中文学校正式加盟华夏中文学校','<h2>本校加盟华夏中文学校</h2>\r\n<p>\r\n经过认真考核，华夏中文学校在8月5日的会议上正式批准伯克利华夏中文学校加入华夏中文学校系统。2017-2018学年，本校在继续办好现有中文教学和传播中华文化的基础上，将积极参加总校举办的智力运动会，教师年会，演讲比赛，辩论比赛等多项活动。\r\n</p>\r\n\r\n<p>\r\n华夏中文学校是北美规模最大的华文教育机构，学生逾7000人，共有22所分校在新州、纽约州、康州、宾州。如果需要了解更多总校信息，请访问<a href=\"http://www.hxcs.org\">http://www.hxcs.org</a>。\r\n</p>','notification','2017-08-30 03:52:20',NULL),(43,NULL,'Shop through Amazon Smile to support our school','<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"https://smile.amazon.com/ch/81-1283070\" target=\"_blank\"><img src=\"http://www.huaxiabh.org/Content/img/amazonsmile.png\" style=\"height: 70%; width: 70%;\"></a>\r\n      <p style=\"font-size: 1.2em; font-weight: bold;\">\r\n      Simply click on the logo above to enter Amazon.com and a percentage of any resulting purchases will be returned to the Berkeley Heights Huaxia Chinese School.  What a better way to support our school while shopping for your everyday purchases without spending any extra money!\r\n      </p>\r\n\r\n<p>\r\nOr use the direct link <a href=\"https://smile.amazon.com/ch/81-1283070\">https://smile.amazon.com/ch/81-1283070</a>  to add \"Berkeley Heights Huaxia Chinese School\" as your designated non-profit organization. Once added our school to your account, please bookmark smile.amazon.com for your regular Amazon shopping. \r\n</p>\r\n\r\n<ul> We would appreciate it if you share the link above to your family members or friends :)\r\n  <li>\r\n    <a class=\"facebook customer share\" href=\"https://www.facebook.com/sharer.php?u=https://smile.amazon.com/ch/81-1283070\" title=\"Support Berkeley Heights Huaxia Chinese School\" target=\"_blank\">Facebook</a>\r\n  </li>\r\n  <li>\r\n    <a class=\"twitter customer share\" href=\"https://twitter.com/share?url=https://smile.amazon.com/ch/81-1283070;text=Support Berkeley Heights Huaxia Chinese School;\" title=\"Support Berkeley Heights Huaxia Chinese School\" target=\"_blank\">Twitter</a>\r\n  </li>\r\n  <li>\r\n    <a class=\"google_plus customer share\" href=\"https://plus.google.com/share?url=https://smile.amazon.com/ch/81-1283070\" title=\"Support Berkeley Heights Huaxia Chinese School\" target=\"_blank\">Google Plus</a>\r\n  </li>\r\n\r\n</ul>\r\n\r\n</div>\r\n\r\n','notification','2017-11-14 15:21:30',NULL),(44,NULL,'Donate to our school 如何向我校捐赠?','伯克利华夏中文学校是一个会员制的非营利组织。自2016年建校以来，广大家长积极参与学校运作，为学校做了大量的义务工作，同时也捐款、捐物给学校，使我们的学校越办越好。我校具有联邦国税局批准的501(C)(3)身份。向学校捐款、捐物的公司、机构或个人都可以对捐赠部分免交联邦税。目前，我校除了孩子们中文课和文化课的教育活动以外，还开展了丰富多彩的社区文化活动。您在捐赠时可以注明您捐赠的目的和用途，以支持学校的各项活动。下面是您通过A，B，C，D任何一种方式向我校捐赠时，您需要的有关信息。\r\n<br><br>\r\n\r\n<a href=\"#united\">A.  通过 UNITED WAY 捐款</a><br>\r\n<a href=\"#check\">B. 支票</a><br>\r\n<a href=\"#community\">C. 通过社区服务(Community services)的公司match</a><br>\r\n<a href=\"#other\">D. 其他物品捐赠</a><br>\r\n<br><br>\r\n\r\n<p id=\"united\">\r\n<b> A.  通过 UNITED WAY 捐款给我校，请注意以下几点：</b>\r\n<br><br>\r\n1.  当填写捐款表格 (Donor Choice Form)  时，选择 501(C) (3)  专栏，或在捐款表格中选择 “Donor Choice”。   除一般要填写的表格之外，您可能需填写另外的卡片或表格。\r\n<br><br>\r\n2.  我校的英文名称(Agency Name)为：Berkeley Heights Huaxia Chinese School  \r\n<br>\r\n在 \"Donor Designation\"  一栏，   填写受款组织名称 \"  Berkeley Heights Huaxia Chinese School \".\r\n<br><br>\r\n 3.  学校的联邦Tax ID为：<b>81-1283070</b>\r\n<br><br>\r\n 4.  受款组织地址一栏, 请您务必填写上伯克利华夏中文学校的地址(Agency Address):<br><br>\r\n\r\n 364 Springfield Ave #539<br>\r\n Berkeley Heights, NJ 07922<br>\r\n<br>\r\n 5.  只有注明学校的地址，您的捐款才会直接转寄到我们学校,  否则,  我们学校无法收到您的捐款。<br><br>\r\n6.  请注明您的姓名，单位及地址，以便我们在收到您的捐款后可以感谢您。<br><br>\r\n7.  填写捐款表格时，请您仔细检查以上各项。<br>\r\n<br>\r\n<b>Q&A:</b><br><br>\r\n\r\n问:  我公司提供的授款组织的名单中, 没有Berkeley Heights Huaxia Chinese School。  请问如何捐款?<br>\r\n 答:  您仍然可以指定Berkeley Heights Huaxia Chinese School为授款组织，并填写所在学校的地址。<br><br>\r\n  问:  我公司的 Company Match  只给特定类的或在特定郡县的组织。 请问我是否仍可捐款给Berkeley Heights Huaxia Chinese School?<br>\r\n 答:  可以。   即使我校拿不到贵公司的 Company Match，  我校仍可得到您通过 UNITED WAY  的捐款。<br><br>\r\n  问:  我公司只捐款给UNITED WAY的注册会员。请问如何捐款?<br>\r\n 答:  原则上讲, 任何具有 501(C)(3)  身份的组织均可通过UNITED WAY接受捐款， 并不受会员身份的限制。 如公司坚持上述做法，请按下述步骤处理:<br>\r\n     1.请公司与 UNITED WAY Tri-States Office 联系， 澄清有关问题并核实Berkeley Heights  Huaxia Chinese School的 501(C)(3)  身份。<br>\r\n    2.如上述不能解决问题，请尽力问清楚公司联系人的姓名和电话，及公司与之合作的 UNITED WAY  的办公室的联系人的姓名和电话，并尽快告知学校的校长。<br><br>\r\n</p>\r\n\r\n<p id=\"check\">\r\n<b>B.  直接写支票向我校捐款，请注意以下几点：</b><br><br>\r\n\r\n1.  我们学校的联邦Tax ID为：<b>81-1283070</b><br><br>\r\n\r\n 2.  Make check payable to <b>BH Huaxia</b>, and put <b>Donation</b> in the memo, mail to:<br><br>\r\n\r\n 364 Springfield Ave #539<br>\r\n Berkeley Heights , NJ 07922<br><br>\r\n\r\n 3.  有些公司在得知您捐款给我们学校这样的非营利机构时，愿意从公司的捐款基金中追加(match fund)，有的公司非常慷慨，最多可追加您捐赠额的200%。因此，请您通知贵公司有关部门您的捐款意向，询问有关规定。我们学校将出具所需证明。<br><br>\r\n</p>\r\n\r\n<p id=\"community\">\r\n<b>C.  您作为我们学校的家长，平时为学校服务所花费的时间，有的公司会以您作为该公司员工对社区服务 (Community services)  的名义，向我们学校捐款。请您到贵公司的Community Service Program  或Human Resources Dept.询问有关规定。我们学校将提供所需证明。</b>\r\n</p>\r\n\r\n<p id=\"other\">\r\n<b>D.  您也可以向我们学校捐赠教学或学校管理所需物品，或是发给学生的奖品等等。</b>\r\n</p>\r\n','notification','2017-11-29 21:05:20',NULL),(45,'Parent Duty','Parent Duty Deposit  家长值班押金','<div class=\"row\" style=\"padding-top: 10px;\">\r\n<!--    <p style=\"font-size: 1.2em; font-weight: bold;\">\r\n         <a href=\"http://www.huaxiabh.org/Content/documents/PTA/BH%20Huxia%20Parent%20Duty%20Schedule%202017-2018.pdf\" target=\"_blank\">Parent Duty Schedule家长值班表</a>\r\n     </p>\r\n-->\r\n     <p style=\"font-size: 1.2em; font-weight: bold;\">\r\n         <a href=\"http://www.huaxiabh.org/Content/documents/PTA/BH%20Huaxia%20Parent%20Duty%20Deposit%20Refund%20Form.pdf\" target=\"_blank\">Refund Form for Parent Duty Deposit 值班押金退还表</a>\r\n     </p>\r\n</div>','notification','2018-02-09 17:25:21',NULL),(46,'huaxia debate','2018 Huaxia Debate 华夏辩论赛','<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"#\" target=\"_blank\"><img class=\"img-responsive img-rounded\" src=\"http://www.huaxiabh.org/Content/img/huaxiadebate01.jpg\" style=\"\"></a>\r\n</div>\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"#\" target=\"_blank\"><img class=\"img-responsive img-rounded\" src=\"http://www.huaxiabh.org/Content/img/huaxiadebate02.jpg\" style=\"\"></a>\r\n</div>\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"#\" target=\"_blank\"><img class=\"img-responsive img-rounded\" src=\"http://www.huaxiabh.org/Content/img/huaxiadebate03.jpg\" style=\"\"></a>\r\n</div>','notification','2018-05-04 19:46:00',NULL),(47,NULL,'Welcome Sponsors','<p>伯克利华夏中文学校是一个会员制的非营利组织。自2016年建校以来，在广大家长积极参与学校运作，学校蒸蒸日上。为支持学校，也同时宣传社区商家。学校设立以下赞助项目</p>\r\n<p>钻石赞助商：$1,000+ per year</p>\r\n<p>白金赞助商：$800+ per year</p>\r\n<p>金牌赞助商：$500+ per year</p>\r\n<p>银牌赞助商：$300 per year</p>\r\n\r\n<div>\r\n<h3>宣传形式</h3>\r\n<ol>\r\n<li>学校官方网站主页广告版面</li>\r\n\r\n<li>学校email mailing list: Berkeley Heights, New Providence, Summit, Chatham, Long Hill township, Warren, Westfield etc. </li>\r\n\r\n<li>伯克利华夏中文分校微信群定期推送</li>\r\n\r\n<li>Sponsor可以联系我校举办seminar，information session等 (伯克利华夏-华人专业人士服务讲座系列， 例如家长如何和子女沟通，教育类，普及考试和申请大学的讲座, 中老年健康讲座，退休计划，家庭理财，房屋市动态，贷款和refinance等讲座)</li>\r\n\r\n<li>Special Events: 学校每年会举办例如万圣节，中秋节，春节晚会等重要的活动，欢迎热心商家赞助</li>\r\n• 对于重量级的活动比如春晚，我们会提供独家冠名权\r\n\r\n<li>赞助其他体育活动</li>\r\n</ol>\r\n\r\n欢迎email至 sponsor@huaxiabh.org \r\n\r\n</div>','advertisement','2018-05-07 00:19:43',NULL),(48,'contact','Contact Us','<p><a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n<h2> Contact Us</h2>\r\n\r\n<address>\r\n    <strong>Email:</strong> <a href=\"mailto:info@huaxiabh.org\">info@huaxiabh.org</a><br />\r\n    <strong>Mail Address:</strong>\r\n        <br />\r\n       364 Springfield Ave #539<br />\r\n       Berkeley Heights, NJ 07922<br />\r\n    <strong>School Address:</strong>\r\n    <br />\r\n    345 Plainfield Ave<br /> Berkeley Heights, NJ 07922\r\n</address>','notification','2018-05-08 01:45:25',NULL),(49,NULL,'学校规章(Bylaws)','<a \r\nhref=\"http://www.huaxiabh.org/Content/documents/BHHXCS%20School%20Bylaws%E5%AD%A6%E6%A0%A1%E8%A7%84%E7%AB%A0.pdf\">伯克利华夏中文学校规章制度(Bylaws)</a>','policy','2018-05-08 02:28:18',NULL),(50,'2019 Chinese New Year Celebrations','2019 Chinese New Year Celebrations','<div>\r\n\r\n<h2><a href=\"https://www.tapinto.net/towns/berkeley-heights/articles/berkeley-heights-chinese-community-hosted-chinese-new-year-culture-fair-and-spectacular-show\" target=\"_blank\">媒体报道 TAPinto Berkeley Heights</a></h2>\r\n<h2><a href=\"https://goo.gl/44zxKo\" target=\"_blank\">2/3春节联欢游园和演出照片合集(culture fair albums)</a></h2>\r\n<h2><a href=\"https://goo.gl/JJpvBu\" target=\"_blank\">春晚Youtube视频合集(Performance video full version)</a></h2>\r\n<h2><a href=\"https://goo.gl/d9gPxT\" target=\"_blank\">游园全家福(family photo, by request only)</a></h2>\r\n\r\n</div>','notification','2019-02-05 14:40:30',NULL),(51,'课程表和课程介绍','2019-2020 Course Catalog 课程目录','<h2>2019-2020学年课程表和主要课程介绍</h2>\r\n<p>\r\n<strong>一、普通中文课</strong>\r\n</p>\r\n\r\n<p>\r\n学校组建了一支由华夏资深教师带领的优秀中文教师队伍，通过与中文教育专家的探讨和同家长的深度沟通，学校决定使用国务院侨办组织编写的《中文》作为普通中文课教材；学校还同华夏资深教师和海外中文教育顾问合作制定了具有自身特色的教学理念，教学方法，课程安排，以及教案设计。请通过下面的连接来了解我们的课程安排和教学特色。\r\n</p>\r\n\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/spreadsheets/d/1w19HPuifFGIuRKWrajpMcTsDeQHq2b0B9WSKqVEDV8w/edit?usp=sharing\" target=\"_blank\">课程列表Course Catalog</a></span> ||\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/file/d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\">中文课详细介绍 Course Descriptions for Chinese Classes</a></span> \r\n\r\n<p>\r\n <a href=\"http://www.hwjyw.com/textbooks/downloads/zhongwen/\" target=\"_blank\">请点击下载中文教材(学校会发教材）</a>\r\n</p>\r\n\r\n\r\n\r\n<p> \r\n<strong>二、文化课和其它主要相关课程：学校聘请了在专业领域有名望有造诣的文化课老师来丰富学校的文化课程，请点击课程名称来下载课程介绍。</strong>\r\n </p>\r\n<p>\r\n<a href=\"https://drive.google.com/open?id=0B8E9IyDma37OX3pBaC01ZS1fdTA\" target=\"_blank\">少年中文补习班</a>，  <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OWUhKX01CY3BkSWM\" target=\"_blank\">CSL双语班</a>，  <a href=\"http://www.huaxiabh.org/Content/documents/course/%E6%96%87%E5%AD%A6%E8%89%BA%E6%9C%AF%E4%B8%AD%E7%9A%84%E4%B8%AD%E5%9B%BD%E5%8E%86%E5%8F%B2%E4%B8%8E%E6%96%87%E5%8C%96Chinese%20History%20and%20Culture.pdf\" target=\"_blank\">文学艺术中的中国历史与文化</a> ， <a href=\"https://drive.google.com/open?id=0B8E9IyDma37OUFZSNDhsYTQ0dnc\" target=\"_blank\">成人英语班ESL</a>，  \r\n\r\n</p>\r\n\r\n<p>\r\n中文课涵盖学前小班，学前大班，一年级至九年级，CSL 以及中文补习班等。参考最新文化课课程设置调查问卷，应大家的强烈要求，<span style=\"font-weight:bold; color:red;\">2019-2020学年开设(或预开始)的文化体育类课程</span>如下 (具体课程简介和注册要求参看上边链接):\r\n<ul>\r\n<li>\r\n中文AP (10th Grade and higher, passed HSK4)</li>\r\n<li><a href=\"https://drive.google.com/file/d/17sKobRAnksKlb_aTQLCQzd8jjdoVJqk2/view?usp=sharing\" target=\"_blank\">英文写作/辩论 English Essay&Debate 7th-9th Grade</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Highly recommend!</span></li>\r\n<li><a href=\"https://drive.google.com/file/d/1pEJRDVIKv9C3XbrPC9DQiVIUQC9RzcNt/view?usp=sharing\" target=\"_blank\">数学 Elite Math</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1Hhybf-bgKbwTVNaD4DCNErCdfihodd9t\" target=\"_blank\">书法+水粉画 Chinese Calligraphy&Painting</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1xG_1OJ6s4BftmQq8ElPdIUdO_we-xJJX/view?usp=sharing\" target=\"_blank\">唱游班 Kids Singing& Dancing</a>(3-6岁)</li>\r\n<li><a href=\"https://drive.google.com/open?id=16p13Fa7zLNmB9v3fY0OWnLMK9cWsqLz1\" target=\"_blank\">舞蹈 Dancing</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=13SVChTytdHlkVk4UZi_HofILWy0gdQ1E\" target=\"_blank\">爵士舞(成人) Jazz (Adult)</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1ri0EZuzUMQHw7QJ4zAuJiWJ-n-Cz0NP_\" target=\"_blank\">瑜伽(成人) Yoga</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/18c2zo_BlmXTReMArRlFCjdTUBOXwCUIW/view?usp=sharing\" target=\"_blank\">服装缝制工艺课 Sewing and Tailoring Technique</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1uqxS4_HcN4qKdLDzY2_z-IMrJwGZadj8/view?usp=sharing\" target=\"_blank\">国际象棋 Chess</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Highly recommend!</span></li>\r\n<li><a href=\"https://drive.google.com/file/d/1PmWuY601fXoun-43QPSwcvCUuHPfDrbz/view?usp=sharing\" target=\"_blank\">中国历史与文化 Chinese History and Culture</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1BLdgLeBFeX2vEPOR8qdSYur3EtQrvqTN/view?usp=sharing\" target=\"_blank\">美术绘画 Drawing Art </a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1X1QAyraxlCWi-z8Lqy3WELbrC8c9KULA/view?usp=sharing\" target=\"_blank\">少儿武术Youth Kung fu (Chinese martial arts)</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1imy91ZF630oZ-oK5J8khgNX7z_UcElmo/view?usp=sharing\" target=\"_blank\"><del>太极成人班 Tai Chi</del></a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1HJ1hSzRVEk0i01qCMBzul5PaF-gsgGfy/view?usp=sharing\" target=\"_blank\"><del>手工Art & Craft</del></a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Ww82auigIImIW28NLzDBtRuft2G5PZZU/view?usp=sharing\" target=\"_blank\"><del>围棋 Youth Go</del></a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Q8obUc60WPJX0x5Tm6meozycWcubOQ_e/view?usp=sharing\" target=\"_blank\">ESL英语成人班</a>(面向新移民和探亲父母等)</li>\r\n</ul>\r\n欢迎大家踊跃报名, 家长可以先根据兴趣报名，我们会根据报名人数的多少来调整课程时间，谢谢家长的理解和配合 :) The Course Schedule will be finalized in late August according to the the enrollment of the classes.\r\n</p>','notification_archived','2019-05-07 18:58:07',NULL),(52,'2019-2020注册','2019-2020 Registration and Course Catalog注册公告','<p>\r\n\r\n<a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n<span style=\"align:center\"><h2>2019-2020学年注册公告 2019-2020 School Year Registration</h2></span>\r\n<p>\r\n各位家长朋友们好！作为立足华人社区的501(c)(3)非营利组织, 经过三年的发展，我校由华夏资深教师带领的优秀中文教师队伍逐步成熟，并且学校积极拓展了由名望极高的文化课老师教授的丰富多彩的文化课程。牢记著名钢琴家和联合国和平使者郎朗先生的衷心祝福和殷切希望 “祝愿华夏中文学校越办越好！把中华文化发扬光大！”，两届九年级毕业班陆续全部以优异成绩通过汉考HSK四级和五级。北京召开的“第四届世界华文教育大会”上，我校黄镁老师 （学前小班和少年中文补习班），和邵天毅（三年级和九年级）老师获得了由国侨办和海外交流协会颁发的“海外华文教师优秀奖” 。本学年我校陆续参加了华夏总校的智力运动会，演讲比赛以及辩论赛等大赛，均斩获佳绩，同学们获取了丰富和宝贵的大赛经验和锻炼。</p>\r\n<p>\r\n在与海外中文教育专家的长期探讨和同家长的深度沟通中，学校在努力逐步完善适合自身发展，富有自己特色的教学方案和教学理念（<a href=\"https://drive.google.com/open?id=0B8E9IyDma37Ob3NqNzZWS2JfWTQ\"><font color=\"blue\">中文课教学特点介绍</font></a>)，同时也选择暨南大学《中文》作为我们普通中文课教材（<a href=\"http://www.hwjyw.com/textbooks/downloads/zhongwen/\"><font color=\"blue\">点击下载</font></a>)。学校的教学器材及各项教学组织保障工作也都已经稳定。 \r\n<p>\r\n伯克利华夏中文学校2019-2020学年注册选课具体通告如下：\r\n</p>\r\n<p>\r\n详情请参考 <span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/open?id=1qLjto1lr8coTwwdyMZ8oeYwXdqdq4_Iz\" target=\"_blank\">注册须知中文版</a></span> || <span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/open?id=1sVmvN1RE7qBDTMpxxzfPPTXWYiRZldPf\" target=\"_blank\">Registration Guidelines</a></span> ||\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/spreadsheets/d/1bPiMvZMUzYsts-t4b_1jrPGDClnPrHJ4m0AOBLTC1SM/edit?usp=sharing\" target=\"_blank\">课程目录Course Catalog</a></span> ||\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/file/d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\">中文课详细介绍 Course Descriptions for Chinese Classes</a></span> \r\n</p>\r\n<p>\r\n 1. 学生注册将以家庭为单位，每个家庭需要建立自己的单独账户。<span style=\"font-weight:bold; color:red;\">Early Bird saving of $50 Registration Fee by 6/8 截至6月8日前注册的家庭享受免$50注册费的优惠</span>\r\n</p>\r\n<p>\r\n2. 中文课涵盖学前小班，学前大班，一年级至九年级，CSL 以及中文补习班等。因教材供货渠道发生变化, 本学年加收中文课教材费(textbook fee) $10. 参考最新文化课课程设置调查问卷，应大家的强烈要求，<span style=\"font-weight:bold; color:red;\">2019-2020学年开设(或预开始)的文化体育类课程</span>如下 (具体课程简介和注册要求参看上边链接):\r\n<ul>\r\n<li>\r\n中文AP (10th Grade and higher, passed HSK4)</li>\r\n<li><a href=\"https://drive.google.com/open?id=1AosxHJYHAtF6kKjaxSPAkIg1mZUh9JGD\" target=\"_blank\">双语班 CSL (Chinese as Second Language)</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1S8RRDi1UjijlMQJ2g0IYzDqPFrC0N3az\" target=\"_blank\">中文补习班(少年)Junior Mandarin</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/17sKobRAnksKlb_aTQLCQzd8jjdoVJqk2/view?usp=sharing\" target=\"_blank\">英文写作/辩论 English Essay&Debate 3rd-4th, 5th-6th, 7th-9th Grade</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">著名私教，超值! Super Hot! Highly recommend! Filled very soon, register now before put on waitlist! </span></li>\r\n<li><a href=\"https://drive.google.com/open?id=1jg8eLyr3yEmqx2nJRWhm0kpTMz5FwMhR\" target=\"_blank\">少儿编程班 (Kids Python, recommend 5th Grade+)</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">New, Hot!<span></li> \r\n<li><a href=\"https://drive.google.com/open?id=1E9qmwbOZzNSUQBFtEmyUw7El9W-Bx-yZ\" target=\"_blank\">SAT阅读和写作班 SAT Reading & Writing</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">超值! Very Hot! Filled very soon! </span></li>\r\n<li><a href=\"https://drive.google.com/open?id=1E9qmwbOZzNSUQBFtEmyUw7El9W-Bx-yZ\" target=\"_blank\">SAT数学 SAT Math</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">超值! Very Hot! Register now before put on waitlist! </span></li>\r\n<li><a href=\"https://drive.google.com/open?id=1tAxZkqe5gWSFhdmaHmbrdQtw4HEDXMVZ\" target=\"_blank\">数学强化班 Math Enrichment</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1ZuPcoU5Gp8M2QlUOy6Rv00xj9Qq8E9js/view?usp=sharing\" target=\"_blank\">书法+水粉画 Chinese Calligraphy&Painting</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1xG_1OJ6s4BftmQq8ElPdIUdO_we-xJJX/view?usp=sharing\" target=\"_blank\">唱游班 Kids Singing& Dancing</a>(3-6岁)</li>\r\n<li><a href=\"https://drive.google.com/open?id=16p13Fa7zLNmB9v3fY0OWnLMK9cWsqLz1\" target=\"_blank\">舞蹈 Dancing</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=13SVChTytdHlkVk4UZi_HofILWy0gdQ1E\" target=\"_blank\">爵士舞(成人) Jazz (Adult)</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">New, Hot!</li>\r\n<li><a href=\"https://drive.google.com/open?id=1ri0EZuzUMQHw7QJ4zAuJiWJ-n-Cz0NP_\" target=\"_blank\">瑜伽(成人) Yoga</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1HJ1hSzRVEk0i01qCMBzul5PaF-gsgGfy/view?usp=sharing\" target=\"_blank\">手工Art & Craft</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1-RitNgShTqwO-KygNKM0yFefFzzD5q9V\" target=\"_blank\">服装缝制工艺课 Sewing and Tailoring Technique</a> (年龄不限 opens all age groups)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1uqxS4_HcN4qKdLDzY2_z-IMrJwGZadj8/view?usp=sharing\" target=\"_blank\">国际象棋 Chess</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Highly recommend!</span></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Ww82auigIImIW28NLzDBtRuft2G5PZZU/view?usp=sharing\" target=\"_blank\">围棋 Youth Go</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1PmWuY601fXoun-43QPSwcvCUuHPfDrbz/view?usp=sharing\" target=\"_blank\">中国历史与文化 Chinese History and Culture</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1BLdgLeBFeX2vEPOR8qdSYur3EtQrvqTN/view?usp=sharing\" target=\"_blank\">美术绘画 Drawing Art </a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1X1QAyraxlCWi-z8Lqy3WELbrC8c9KULA/view?usp=sharing\" target=\"_blank\">少儿武术Youth Kung fu (Chinese martial arts)</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1imy91ZF630oZ-oK5J8khgNX7z_UcElmo/view?usp=sharing\" target=\"_blank\">太极成人班 Tai Chi</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Q8obUc60WPJX0x5Tm6meozycWcubOQ_e/view?usp=sharing\" target=\"_blank\">免费ESL英语成人班</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Free to local residents 面向新移民和探亲父母等<span></li>\r\n</ul>\r\n欢迎大家踊跃报名, 家长可以先根据兴趣报名，我们会根据报名人数的多少来调整课程时间，谢谢家长的理解和配合 :) The Course Schedule will be finalized in late August according to the the enrollment of the classes.\r\n</p>\r\n<p>\r\n3. 学校继续租用Columbia Middle School作为校舍，2019年9月份开学，周六下午1:30 到5:00开展中文及其它课程的教学。\r\n</p>\r\n<p>\r\n4. 请先浏览上边链接的课程介绍(包括老师介绍），上课时间，注册规定等其它相关文件和规章。明确你要注册的课程，同时也了解相关收费标准，退学政策，注册政策，以及学校的其它有关规章。\r\n</p>\r\n<p>\r\n 5. 具体注册步骤请参照上面的<span style=\"font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/open?id=1qLjto1lr8coTwwdyMZ8oeYwXdqdq4_Iz\" target=\"_blank\">注册须知</a></span>   <span style=\"font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/open?id=1sVmvN1RE7qBDTMpxxzfPPTXWYiRZldPf\" target=\"_blank\">(English version)</a></span> 。完成网络注册后请在两个星期内邮寄(或周六上课时间到校drop off)选课单和支票给学校。学校在收到付款后会在系统里确认注册成功。\r\n</p>\r\n<p>\r\n6. 有些文化课很受欢迎可能会比较快报满，请尽快注册。如果课程报名学生过多，学校将按照报名先后的顺序来安排。\r\n</p>\r\n<p>\r\n7. 文化课的注册不会影响中文课的注册，中文课没有名额限制。很多华夏的中文老师一直跟学校保持联系，中文课将以小班为主，注册学生多了学校可以联系有经验的华夏老教师再开班。\r\n</p>\r\n<p>\r\n8. 为了系统安全，在你建立login后，系统会自动发confirm email到你提供的邮箱，你需要点击confirm来确认。我们的confirm email可能会被转到你邮箱的spam folder，请注意查收。\r\n</p>\r\n\r\n<p>\r\n帮助孩子学习中文，在本地传播中国文化，为本地华人社区服务是学校的宗旨。我们愿意与大家共同努力建设一所高质量的、可持续发展的中文学校。如果您对学校工作有什么疑问和建议，请随时联系我们。\r\n</p>','notification_chinese_version','2019-05-08 16:06:29',NULL),(53,'2020-2021 Registration and Course Catalog','2020-2021 Registration 新学年注册公告','<p>\r\n     <a href=\"https://drive.google.com/open?id=0B8GkbQ8_vZjcelNUVWdsTERpSnM\">强力推荐大家阅读一位华夏教师的心声，爱是教育的基础，也是我们伯克利华夏中文学校的基石</a>\r\n</p>\r\n\r\n<!-- 新学期注册公告 -->\r\n<span style=\"align:center\"><h2><a href=\"/Home/ViewMessage/53\" target=\"_blank\">2020-2021 School Year Registration</a></h2></span>\r\n<p>\r\nBerkeley Heights Huaxia Chinese School (BHHXCS) is located at Columbia Middle School, opens to all residents in the neighborhood. BHHXCS is a <strong>501(c)(3) nonprofit organization</strong>, a community oriented, cultural educational institute. Early Bird Registration for the 2020-2021 school year now begins! </p>\r\n\r\n<p>\r\nIMPORTANT: Please refer to <span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/document/d/1YZZnxl9jNEzqq1f6tCCoFeKuOD1U6QKYtRpWBb0KebU/edit?usp=sharing\" target=\"_blank\">中文版</a></span> || <span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/document/d/1yNgmr_pxLtE6qbErxrYLxXxqLL02jkMqU5TE_o2oNb8/edit?usp=sharing\" target=\"_blank\">Registration Guidelines</a></span> ||\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://docs.google.com/spreadsheets/d/1eFtg3fIrGAI5hoHOgV10N1xF9Q_X4nh6E2n4PPXEpRc/edit?usp=sharing\" target=\"_blank\">Course Catalog (课程目录及学费)</a></span> ||\r\n<span style=\"font-size: 1.2em;font-weight:bold;color:bold;\"><a href=\"https://drive.google.com/file/d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\">Course Descriptions for Chinese Classes (中文课)</a></span> \r\n</p>\r\n\r\n<p>\r\n 1. One account per family <span style=\"font-weight:bold; color:red;\">Early Bird saving of $50 Registration Fee by July 6</span>\r\n</p>\r\n\r\n<p>\r\nTo honor your registration, Do make sure you mail the copy of your <span style=\"font-weight:bold; color:red;\">registration summary (MUST BE SIGNED!)</span> with check payable to <strong>BH Huaxia</strong> to  364 Springfield Ave #539, Berkeley Heights, NJ 07922, <span style=\"font-weight:bold; color:red;\">failure to do in two weeks so will void your registration</span>.\r\n</p>\r\n<p>\r\n2. <a href=\"https://drive.google.com/open?id=0B8E9IyDma37Ob3NqNzZWS2JfWTQ\" target=\"_blank\"><font color=\"blue\">中文课教学特点介绍</font></a>, <a href=\"http://www.hwjyw.com/textbooks/downloads/zhongwen/\" target=\"_blank\"><font color=\"blue\">Download Textbook</font></a> <a href=\"https://drive.google.com/file/d/1Y3rSLuHrXH92MiVOLcj9BW2yvCZE1KzR/view?usp=sharing\" target=\"_blank\">Chinese Language classes: Preschool, Kindergarten, 1st to 9th Grade,  CSL (Chinese as Second Language) and Junior Mandarin</a>. <br />\r\n \r\n</p>\r\n<p>\r\n3. <span style=\"font-weight:bold; color:blue;\">All popular Cultural classes to be offered:</span>\r\n<ul>\r\n<li><a href=\"https://drive.google.com/open?id=1AosxHJYHAtF6kKjaxSPAkIg1mZUh9JGD\" target=\"_blank\">双语班 CSL (Chinese as Second Language)</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1S8RRDi1UjijlMQJ2g0IYzDqPFrC0N3az\" target=\"_blank\">中文补习班(少年) Junior Mandarin</a></li>\r\n<li>AP Chinese (10th Grade and higher, passed HSK4)</li>\r\n<li>英文阅读写作 English Reading&Writing (<a href=\"https://drive.google.com/open?id=14rOgH8lPzWfDbY2TKAo75NkTMzxhkUUL\" target=\"_blank\">for 3rd-4th and 5th-6th grades</a>, <a href=\"https://drive.google.com/file/d/17sKobRAnksKlb_aTQLCQzd8jjdoVJqk2/view?usp=sharing\" target=\"_blank\">for 7th-9th Grade</a>)</li>\r\n<li><a href=\"https://drive.google.com/open?id=1jg8eLyr3yEmqx2nJRWhm0kpTMz5FwMhR\" target=\"_blank\">少儿编程班 (Kids Python, recommend 5th Grade+)</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">space limited, register asap before full<span></li> \r\n<li><a href=\"https://drive.google.com/open?id=1Lm80ioWLPpyQslmlzQAO45RKkAQ97enU\" target=\"_blank\">SAT阅读和写作班 SAT Reading & Writing</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1Z33cLQSKc2yKJDtBR0NGPho2biA_Aemh\" target=\"_blank\">数学强化班 Math Enrichment</a>4 Levels for 1st to 8th Grade <span style=\"font-weight:bold; color:red;padding-left:5px;\">For Grade 7&8 concentrate on AMC8-American Mathematics Contest 8, register asap before full<span></li>\r\n<li><a href=\"https://drive.google.com/file/d/1ZuPcoU5Gp8M2QlUOy6Rv00xj9Qq8E9js/view?usp=sharing\" target=\"_blank\">书法+水粉画 Chinese Calligraphy&Painting</a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1xG_1OJ6s4BftmQq8ElPdIUdO_we-xJJX/view?usp=sharing\" target=\"_blank\">唱游班 Kids Singing& Dancing</a>(3-6岁)</li>\r\n<li><a href=\"https://drive.google.com/file/d/1HJ1hSzRVEk0i01qCMBzul5PaF-gsgGfy/view?usp=sharing\" target=\"_blank\">手工Art & Craft</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1-RitNgShTqwO-KygNKM0yFefFzzD5q9V\" target=\"_blank\">服装缝制工艺课 Sewing and Tailoring Technique</a> (年龄不限 opens all age groups)</li>\r\n<li><a href=\"https://drive.google.com/open?id=11Bc4V5PC8FTroBdITB4cBePA25Lh9TCN\" target=\"_blank\">国际象棋 Chess</a></li>\r\n<li><a href=\"https://drive.google.com/open?id=1Rf7OcLxXT-JXWjrUqmuQjHbLRhqRMil7\" target=\"_blank\">3D 打印（3D Printing & Science Class)</a></li> \r\n<li><a href=\"https://drive.google.com/file/d/1BLdgLeBFeX2vEPOR8qdSYur3EtQrvqTN/view?usp=sharing\" target=\"_blank\">美术绘画 Drawing Art </a></li>\r\n<li><a href=\"https://drive.google.com/file/d/1Q8obUc60WPJX0x5Tm6meozycWcubOQ_e/view?usp=sharing\" target=\"_blank\">免费ESL英语成人班</a><span style=\"font-weight:bold; color:red;padding-left:5px;\">Free to local residents 面向新移民和探亲父母等<span></li>\r\n</ul>\r\nThe Course Schedule will be finalized in late August according to the the enrollment of the classes.\r\n</p>\r\n<p>\r\n4. We are located at Columbia Middle School, school opens on Saturdays (1:30pm - 5pm) during school year of BH Public Schools.\r\n<div style=\"font-weight:bold; color:red;padding-left:5px;\">\r\n<p>* To help parents deal with the uncertainty and ease the concerns might be caused by COVID-19 possibly into new school year, our school may stays online for a period of time while evaluating the developing situation by then, any Cultural/Enrichment classes that can\'t be offered online are eligible for prorated refund/credit.\r\n</p>\r\n</div>\r\n\r\n\r\n<p>\r\n帮助孩子学习中文，在本地传播中国文化，为本地华人社区服务是学校的宗旨。我们愿意与大家共同努力建设一所高质量的、可持续发展的中文学校。如果您对学校工作有什么疑问和建议，请随时联系我们。\r\n</p>\r\n\r\n</p>\r\n\r\n','notification','2019-08-16 13:18:05',NULL),(54,NULL,'BH中文学校2018－2019年度活动汇总','<div class=\"row\" style=\"padding-top: 10px;\">\r\n     <a href=\"https://www.tapinto.net/towns/berkeley-heights/articles/berkeley-heights-chinese-community-hosted-chinese-new-year-culture-fair-and-spectacular-show\" target=\"_blank\"><img src=\"https://drive.google.com/uc?export=view&id=1fwfkD-wm7B5k9m6SlJonbgXj0JDBv6gH\" style=\"height: 100%; width: 100%;\"></a>\r\n</div>\r\n\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"https://drive.google.com/open?id=1VeAXjaAQQhVEeTw_cOHNSCRiaTQOftpR\" target=\"_blank\"><img class=\"img-responsive img-rounded\" src=\"http://www.huaxiabh.org/Content/img/huaxiagraduation3.jpg\" style=\"height: 70%; width: 70%;\"></a>\r\n</div>\r\n<p style=\"font-size: 1.2em; font-weight: bold;\">\r\n<a href=\"https://drive.google.com/open?id=1VeAXjaAQQhVEeTw_cOHNSCRiaTQOftpR\" target=\"_blank\">2018 Huaxia Commencement</a>, 6/9/2018@Marlboro, NJ<br />\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"https://drive.google.com/open?id=1Mm4vHmBLYL7BbOoxSLRes7gHrMkegmZx\" target=\"_blank\"><img class=\"img-responsive img-rounded\" src=\"http://www.huaxiabh.org/Content/img/huaxiamind2018.jpg\" style=\"height: 70%; width: 70%;\"></a>\r\n</div>\r\n<p style=\"font-size: 1.2em; font-weight: bold;\">\r\n<a href=\"https://drive.google.com/open?id=1Mm4vHmBLYL7BbOoxSLRes7gHrMkegmZx\" target=\"_blank\">2018 Huaxia Mind Sports</a>, 5/20/2018@Bridgewater, NJ<br />\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"http://www.huaxiabh.org/Home/ViewMessage/46\" target=\"_blank\"><img class=\"img-responsive img-rounded\" src=\"http://www.huaxiabh.org/Content/img/huaxiadebate01.jpg\" style=\"height: 70%; width: 70%;\"></a>\r\n</div>\r\n<p style=\"font-size: 1.2em; font-weight: bold;\">\r\n<a href=\"http://www.huaxiabh.org/Home/ViewMessage/46\" target=\"_blank\">2018 Huaxia Debate</a>, 4/29/2018@Edison, NJ<br />\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n     <p style=\"font-size: 1.2em; font-weight: bold;\">\r\n<a href=\"https://www.meipian.cn/14dcfu6s\" target=\"_blank\">点击阅读2/25春节联欢相关报道，内有图集和视频合集</a>\r\n</p>\r\n      <a href=\"https://www.meipian.cn/14dcfu6s\" target=\"_blank\"><img class=\"img-responsive\" src=\"http://www.huaxiabh.org/Content/img/2018ChineseNewYearShow.jpg\" style=\"height: 70%; width: 70%;\"></a>\r\n</div>\r\n\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n      <a href=\"https://photos.app.goo.gl/xn1WqBTgrRNJzYQx1\" target=\"_blank\"><img class=\"img-responsive img-rounded\" src=\"http://www.huaxiabh.org/Content/img/2018speechcontest.jpeg\" style=\"height: 70%; width: 70%;\"></a>\r\n</div>\r\n<p style=\"font-size: 1.2em; font-weight: bold;\">\r\n<a href=\"https://photos.app.goo.gl/xn1WqBTgrRNJzYQx1\" target=\"_blank\">2018 Huaxia Speech Contest</a>, 1/6/2018@Livingston, NJ<br />\r\n1st Grade: 胡晋衔（JinXian Hu）, 何黛尔(Adele He)， 闫博文(Ryan Yan)\r\n2nd Grade: 施言言（Serena Shi），刘旭洲(Phillip Liu)，永乐(Aden Saket)\r\n3rd Grade: 束嘉星(Kevin Shu)，俞心安(Lillian Yu)，周振宜(Ethan Zhou)\r\n</p>\r\n\r\n\r\n<div class=\"row\" style=\"padding-top: 10px;\">\r\n     <a href=\"http://www.huaxiabh.org/Content/img/20171114112440.jpg\" target=\"_blank\"><img class=\"img-responsive img-rounded\" src=\"http://www.huaxiabh.org/Content/img/20171114112440.jpg\" style=\"height: 70%; width: 70%;\"></a>\r\n    <p style=\"font-size: 1.2em; font-weight: bold;\">\r\n         Our teacher representatives, (front row from left to right) 林虹老师 (Ms. Hong Lin, 2nd Grade), 胡筱榕老师 (Ms. Xiaorong Hu, 4th Grade), 黄亦格老师(Ms. Yige Huang, 6th Grade), 黄镁老师 (Ms. Mei Huang, Preschool and Junior Mandarin), \r\n黄晓燕老师 (Ms. Xiaoyan Huang,1st Grade, ), and 副校长徐天昕 (Vice Principal Mr. Tianxin Xu, back) attended the 2017 Huaxia Teacher Conference at East Brunswick, NJ \r\n    </p>\r\n</div>','notification_archived','2020-03-07 14:06:22',NULL);
